INSERT INTO `episodes` (`id`, `season_id`, `name`, `description`, `rank`, `video_file`, `created_at`, `updated_at`, `deleted_at`) VALUES ('11', '6', 'Gets Lost In Space', 'Arnold\'s know-it-all cousin Janet drives the kids crazy when she joins Ms. Frizzle\'s class on a field trip and gets them lost in outer space!', '001', 'ed969c01e0.mp4', '2018-10-20 16:48:42', '2018-10-20 23:57:46', NULL),
('12', '7', 'The farmer in the dell', 'The farmer in the dell (2x)\r\nHi-ho, the derry-o\r\nThe farmer in the dell\r\nThe farmer takes a wife (2)\r\nHi-ho, the derry-o\r\nThe farmer takes a wife\r\nThe wife takes the child (2)\r\nHi-ho, the derry-o\r\nThe wife takes the child\r\nThe child takes the nurse (2)\r\nHi-ho, the derry-o\r\nThe child takes the nurse\r\nThe nurse takes the cow (2)\r\nHi-ho, the derry-o\r\nThe nurse takes the cow\r\nThe cow takes the dog (2)\r\nHi-ho, the derry-o\r\nThe cow takes the dog\r\nThe dog takes the cat (2)\r\nHi-ho, the derry-o\r\nThe dog takes the cat\r\nThe cat takes the mouse (2)\r\nHi-ho, the derry-o\r\nThe cat takes the mouse\r\nThe mouse takes the cheese (2)\r\nHi-ho, the derry-o\r\nThe mouse takes the cheese\r\nThe cheese stands alone (2)\r\nHi-ho, the derry-o\r\nThe cheese stands alone', '001', '25b33f67b3.mp4', '2018-10-20 22:19:10', '2018-10-20 22:44:02', NULL),
('13', '7', 'This old man', 'Lyrics:\r\nOne!\r\nThis old man, he played one.\r\nHe played knick-knack on my thumb.\r\nWith a knick-knack patty-whack, give a dog a bone,\r\nThis old man came rolling home.\r\n\r\nTwo!\r\nThis old man, he played two.\r\nHe played knick-knack on my shoe.\r\nWith a knick-knack patty-whack, give a dog a bone,\r\nThis old man came rolling home.\r\n\r\nThree!\r\nThis old man, he played three.\r\nHe played knick-knack on my knee.\r\nWith a knick-knack patty-whack, give a dog a bone,\r\nThis old man came rolling home.\r\n\r\nFour!\r\nThis old man, he played four.\r\nHe played knick-knack on my door.\r\nWith a knick-knack patty-whack, give a dog a bone,\r\nThis old man came rolling home.\r\n\r\nFive!\r\nThis old man, he played five.\r\nHe played knick-knack on my hive.\r\nWith a knick-knack patty-whack, give a dog a bone,\r\nThis old man came rolling home.\r\n\r\nSix!\r\nThis old man, he played six.\r\nHe played knick-knack on my sticks.\r\nWith a knick-knack patty-whack, give a dog a bone,\r\nThis old man came rolling home.\r\n\r\nSeven!\r\nThis old man, he played seven.\r\nHe played knick-knack up in heaven.\r\nWith a knick-knack patty-whack, give a dog a bone,\r\nThis old man came rolling home.\r\n\r\nEight!\r\nThis old man, he played eight.\r\nHe played knick-knack on my gate.\r\nWith a knick-knack patty-whack, give a dog a bone,\r\nThis old man came rolling home.\r\n\r\nNine!\r\nThis old man, he played nine.\r\nHe played knick-knack on my spine.\r\nWith a knick-knack patty-whack, give a dog a bone,\r\nThis old man came rolling home.\r\n\r\nTen!\r\nThis old man, he played ten.\r\nHe played knick-knack once again. \r\nWith a knick-knack patty-whack, give a dog a bone,\r\nThis old man came rolling home.\r\n\r\n-~-~~-~~~-~~-~-', '002', '38eb79e028.mp4', '2018-10-20 22:21:16', '2018-10-20 22:44:27', NULL),
('14', '7', 'Rainbow, Rainbow', 'Lyrics:\r\n\r\nRainbow rainbow, high and bright.  \r\nRainbow rainbow, made of light.\r\nFrom the clouds down to the ground,\r\nI see colors all around.\r\n \r\nRed, orange, yellow, green, blue,\r\nIndigo and violet too.\r\nRed, orange, yellow, green, blue,\r\nIndigo and violet too.\r\n \r\nRainbow rainbow, high and bright.\r\nRainbow rainbow, made of light.\r\nFrom the clouds down to the ground,\r\nI see colors all around.\r\n\r\nRed, orange, yellow, green, blue,\r\nIndigo and violet too.\r\nRed, orange, yellow, green, blue,\r\nIndigo and violet too.\r\n\r\nA rainbow.\r\nA rainbow.\r\n\r\n-~-~~-~~~-~~-~-', '003', 'b95e227272.mp4', '2018-10-20 22:22:46', '2018-10-20 22:44:38', NULL),
('15', '7', 'Alphabet Train Food Train', 'Lyrics:\r\n\r\nHello, hello, alphabet train,\r\nAlphabet train, alphabet train.\r\nHello, hello, alphabet train.\r\nWhats inside today?\r\n\r\nA train, apple train.\r\nB train, banana train.\r\nC train, cookie train. \r\nChoo choo choo!\r\n\r\nD train, donut train.\r\nE train, eggplant train.\r\nF train, french fry train.\r\nChoo choo choo!\r\n\r\nG train, green bean train. \r\nH train, hot dog train.\r\nI train, ice cream train.\r\nChoo choo choo!\r\n\r\nJ train, jellybean train.\r\nK train, kiwi train.\r\nL train, lemon train.\r\nChoo choo choo!\r\n\r\nM train, mango train.\r\nN train, noodle train.\r\nO train, onion train.\r\nChoo choo choo!\r\n\r\nP train, pizza train.\r\nQ train, quince train. \r\nR train, raspberry train.\r\nChoo choo choo!\r\n\r\nS train, sausage train.\r\nT train, tomato train.\r\nU train, upside-down cake train.\r\nChoo choo choo!\r\n\r\nV train, vegetable train.\r\nW train, watermelon train. \r\nX train, xacuti train. \r\nChoo choo choo!\r\n\r\nY train, yogurt train.\r\nZ train, zucchini train.\r\nGoodbye, goodbye, alphabet train.\r\nChoo choo choo!\r\n\r\n-~-~~-~~~-~~-~-', '004', '3f3b696fb2.mp4', '2018-10-20 22:24:37', '2018-10-20 22:44:49', NULL),
('16', '7', 'Count With Me', 'Lyrics:\r\n\r\nHow many? How many?\r\nCount with me. Count with me.\r\nHow many? How many?\r\nCount with me. Count with me.\r\n\r\nHow many horns on a unicorn?\r\nOne. \r\nOne horn. \r\n \r\nHow many wheels on a bicycle?\r\nOne, two. \r\nTwo wheels. \r\n \r\nHow many sides in a triangle?\r\nOne, two, three. \r\nThree sides. \r\n \r\nHow many wings on a butterfly?\r\nOne, two, three, four.\r\nFour wings. \r\n \r\nHow many fingers on one hand?\r\nOne, two, three, four, five. \r\nFive fingers. Five fingers.\r\n\r\nHow many? How many?\r\nCount with me. Count with me.\r\nHow many? How many?\r\nCount with me. Count with me.\r\n\r\nHow many strings on my guitar?\r\nOne, two, three, four, five and six. \r\nSix strings.\r\n\r\nHow many days are in a week?\r\nOne, two, three, four, five, six, seven. \r\nSeven days. \r\n \r\nHow many arms on an octopus?\r\nOne, two, three, four, five, six, seven, eight. \r\nEight arms. \r\n  \r\nHow many players on a baseball team?\r\nOne, two, three, four, five, six, seven, eight, nine. \r\nNine players. \r\n \r\nHow many pins in a bowling lane?\r\nOne, two, three, four, five, six, seven, eight, nine and ten. \r\nTen pins. Ten pins.\r\n\r\nOne, two, three, four, five, six, seven, eight, nine and ten.\r\nOne, two, three, four, five, six, seven, eight, nine and ten.\r\n\r\nHow many? How many?\r\nCount with me. Count with me.\r\nHow many? How many?\r\nCount with me. Count with me.\r\n\r\n-~-~~-~~~-~~-~-', '005', '848b752a24.mp4', '2018-10-20 22:25:27', '2018-10-20 22:45:30', NULL),
('17', '7', 'Head, Shoulders, Knees & Toes', 'Lyrics:\r\n\r\nSing a song,\r\nIt\'s a very neat song.\r\nA song that tells us all about our  \r\n \r\nHead, shoulders, knees and toes, knees and toes.\r\nHead, shoulders, knees and toes, knees and toes,\r\nAnd eyes and ears and mouth and nose.\r\nHead, shoulders, knees and toes, knees and toes.\r\n \r\nHead, shoulders, knees and toes, knees and toes.\r\nHead, shoulders, knees and toes, knees and toes,\r\nAnd eyes and ears and mouth and nose.\r\nHead, shoulders, knees and toes, knees and toes.\r\n \r\nCheeks,\r\nChin,\r\nTummy,\r\nHips,\r\nHands\r\nAnd elbows.\r\nElbows?\r\n \r\nHead, shoulders, knees and toes, knees and toes.\r\nHead, shoulders, knees and toes, knees and toes,  \r\nAnd eyes and ears and mouth and nose.\r\nHead, shoulders, knees and toes, knees and toes.\r\nEyes and ears and mouth and nose.\r\nHead, shoulders, knees and toes, knees and toes.\r\n\r\n-~-~~-~~~-~~-~-', '006', '95ed9c5f62.mp4', '2018-10-20 22:27:50', '2018-10-20 22:45:40', NULL),
('18', '7', 'Old Macdonald Had a Farm', 'Lyrics:\r\n\r\nOld MacDonald had a farm,\r\nE-I-E-I-O! \r\nAnd on that farm he had a cow,\r\nE-I-E-I-O!\r\nWith a moo moo here and a moo moo there, \r\nHere a moo, there a moo, everywhere a moo moo. \r\nOld MacDonald had a farm, E-I-E-I-O.\r\n\r\nOld MacDonald had a farm,\r\nE-I-E-I-O!\r\nAnd on that farm he had a duck, \r\nE-I-E-I-O!\r\nWith an quack quack here and an quack quack there, \r\nHere an quack, there an quack, everywhere a quack quack. \r\nOld MacDonald had a farm, \r\nE-I-E-I-O!\r\n\r\nOld MacDonald had a farm, \r\nE-I-E-I-O!\r\nAnd on that farm he had a horse,\r\nE-I-E-I-O! \r\nWith a neigh neigh here and a neigh neigh there, \r\nHere a neigh, there a neigh, everywhere a neigh neigh. \r\nOld MacDonald had a farm, \r\nE-I-E-I-O!\r\n\r\nOld MacDonald had a farm,\r\nE-I-E-I-O!\r\nAnd on that farm he had a pig, \r\nE-I-E-I-O!\r\nWith an oink oink here and an oink oink there, \r\nHere an oink, there an oink, everywhere an oink oink. \r\nOld MacDonald had a farm, \r\nE-I-E-I-O!\r\n\r\nOld MacDonald had a farm, \r\nE-I-E-I-O!\r\n\r\n-~-~~-~~~-~~-~-', '007', '9d3a977c47.mp4', '2018-10-20 22:28:56', '2018-10-20 22:45:52', NULL),
('19', '7', 'Ghost Family', 'Lyrics:\r\nWere a ghost family. \r\nWere fantastic and friendly.\r\nWhen its time for Halloween,\r\nWe ride out in our limousine.\r\n\r\nWere a ghost family. \r\nWere fantastic and friendly.\r\nWhen its time for Halloween,\r\nWe like to shake our tambourines.\r\n\r\nWe float, we fly, we sweep, we swoop.\r\nWe soar, we glide, we loop-de-loop.\r\nWere on the ground and up high too.\r\nWe love to jump out and say, Boo!\r\n\r\nWere a ghost family. \r\nWere fantastic and friendly.\r\nWhen its time for Halloween,\r\nWe like to pop out on your screen.\r\n\r\nWere a ghost family. \r\nWere fantastic and friendly.\r\nWhen its time for Halloween,\r\nWe bounce around like jumping beans.\r\n\r\nWe float, we fly, we sweep, we swoop.\r\nWe soar, we glide, we loop-de-loop.\r\nWere on the ground and up high too.\r\nWe love to jump out and say, Boo!\r\n\r\nWere a ghost family. \r\nWere fantastic and friendly.\r\nWhen its time for Halloween,\r\nWe flip-flop on our trampoline.\r\n\r\nWere a ghost family. \r\nWere fantastic and friendly.\r\nWhen its time for Halloween,\r\nWere the silliest on the scene.\r\n\r\nWere the spookiest. Were the kookiest.\r\nWere the gobbledygookiest.\r\n\r\nWe float, we fly, we sweep, we swoop.\r\nWe soar, we glide, we loop-de-loop.\r\nWere on the ground and up high too.\r\nWe love to jump out and say, Boo!\r\nWe love to jump out and say, Boo!', '008', '9f6dd275c9.mp4', '2018-10-20 22:30:05', '2018-10-20 22:45:19', NULL),
