('21', '7', 'Ice Cream Song', 'Lyrics:\r\n\r\nGet a scoop of that. Get a scoop of that.\r\nWhat? Ice Cream! \r\nWhat? Ice Cream!\r\nGet a scoop of that. Get a scoop of that.\r\nWhat? Ice Cream! \r\nWhat? Ice Cream!\r\n\r\nWhen the day is hot and steamy,\r\nIce cream is so cold and creamy.\r\nPut it in a cone. Put it in a cup.\r\nI\'m just gonna eat it up!\r\nYeah! Ice cream!\r\nI\'m just gonna eat it up!\r\nYeah! Ice cream!\r\n\r\nGet a scoop of that. Get a scoop of that.\r\nWhat? Ice Cream!\r\nWhat? Ice Cream!\r\nGet a scoop of that. Get a scoop of that.\r\nWhat? Ice Cream!\r\nWhat? Ice Cream!\r\n\r\nVanilla, chocolate and strawberry,\r\nMint chip, butterscotch and cherry.\r\nIce cream, ice cream, we want more!\r\nOne, two, three, four, five scoops!\r\nYeah! Ice cream!\r\nSix, seven, eight, nine, ten scoops!\r\nYeah! Ice cream!\r\nIce cream!\r\nIce cream!\r\nIce cream!\r\nIce cream!\r\n\r\nGet a scoop of that. Get a scoop of that.\r\nWhat? Ice Cream!\r\nWhat? Ice Cream!\r\nGet a scoop of that. Get a scoop of that.\r\nWhat? Ice Cream!\r\nAwesome!\r\nYeah! Ice Cream!\r\n\r\nSugar cones and waffle cones, \r\nYo, there are no awful cones!\r\nSprinkles on it, syrup on it.\r\nDon\'t you put your ear up on it!\r\nNo? \r\nNo, no, you eat it all up, you eat it all up!\r\nYeah! Eat it all up!\r\nIce cream!\r\nIce cream!\r\nIce cream!\r\nYeah! Ice Cream!\r\nWhoo! Ice Cream!\r\nAlright!\r\nYeah, yeah, yeah! Whoo! Ice cream!\r\n\r\n-~-~~-~~~-~~-~-', '009', '269bef5eae.mp4', '2018-10-20 22:32:02', '2018-10-20 22:45:00', NULL),
