('71', '10', 'In the City', 'Ms. Frizzle\'s class is visiting the zoo. To test a theory about wild animals, Ms. Frizzle turns the class into possums, foxes, and falcons!', '012', 'a6cab3255f.mp4', '2018-10-21 14:36:53', '2018-10-25 01:25:53', NULL),
('72', '10', 'Gets Programmed', 'When Ms. Frizzle shrinks the class and sends them inside the computer for a guided tour, everything goes haywire. How will they solve this problem?', '013', '6b8a48f28f.mp4', '2018-10-21 14:37:15', '2018-10-25 01:26:07', NULL),
('73', '11', 'From Pole to Pole', 'The ultimate portrait of our planet looks at the key factors that shape our natural history. \r\nThe lives of animals and plants are dominated by the sun and fresh water which trigger seasonal journeys.', '001', '360dbd8abb.mp4', '2018-10-28 13:28:40', '2018-10-29 00:44:07', NULL),
('74', '11', 'Mountains', 'The ultimate portrait of our planet looks at the key factors that shape our natural history. \r\n\r\nThe lives of animals and plants are dominated by the sun and fresh water which trigger seasonal journeys. ', '002', '78961c5faa.mp4', '2018-10-28 13:29:25', '2018-10-28 13:43:33', NULL),
('75', '11', 'Freshwater', 'Fresh water is our most precious resource and it defines the distribution of life on land. Follow the descent of rivers from their mountain sources to the sea. Watch spectacular waterfalls, fly inside the Grand Canyon and explore the wildlife below the ice.', '003', '94db384245.mp4', '2018-10-28 13:29:56', '2018-10-29 00:43:32', NULL),
('76', '11', 'Caves', 'The Cave of Swallows in Mexico is a 400m vertical shaft, deep enough to engulf the Empire State Building. The Lechuguilla cave system in the USA is 193km long and 500m deep with astonishing crystal formations hanging from its chambers.', '004', '2fb6f29464.mp4', '2018-10-28 13:30:49', '2018-10-29 00:43:03', NULL),
('77', '11', 'Deserts', 'Around 30% of the land\'s surface is desert, the most varied of our ecosystems despite the lack of rain. Unravel the secrets of desert survival and experience the ephemeral nature of this dynamic environment. ', '005', '8fb0ad6529.mp4', '2018-10-28 13:31:25', '2018-10-28 13:47:01', NULL),
('78', '11', 'Ice Worlds', 'The Arctic and Antarctic experience the most extreme seasons on Earth. Time-lapse cameras watch a colony of emperor penguins, transforming them into a single organism. The film reveals new science about the dynamics of emperor penguin behaviour.', '006', '7e2b5aedb3.mp4', '2018-10-28 13:33:04', '2018-10-28 13:47:29', NULL),
('79', '11', 'Great Plains', 'After filming for three years, Planet Earth finally captures the shy Mongolian gazelle. Only a handful of people have witnessed its annual migration. Don\'t miss the bizarre-looking Tibetan fox, captured on film for the first time.', '007', 'bac573c9db.mp4', '2018-10-28 13:33:47', '2018-10-28 13:47:44', NULL),
('80', '11', 'Jungles', 'Jungles cover roughly three per cent of our planet yet contain 50 per cent of the world\'s species. High-definition cameras enable unprecedented views of animals living on the dark jungle floor.\r\nIn the Ngogo forest the largest chimpanzee group in the world', '008', 'da361ae95f.mp4', '2018-10-28 13:34:17', '2018-10-28 13:49:09', NULL),
('81', '11', 'Shallow Seas', 'A humpback whale mother and calf embark on an epic journey from tropical coral paradises to storm ravaged polar seas.\r\nNewly discovered coral reefs in Indonesia reveal head-butting pygmy seahorses, flashing \'electric\' clams and bands of sea kraits.', '009', '2460f18f99.mp4', '2018-10-28 13:35:25', '2018-10-28 13:48:53', NULL),
('82', '11', 'Seasonal Forests', 'The Taiga forest, on the edge of the Arctic, is a silent world of stunted conifers. The trees may be small but filming from the air reveals its true scale. ', '010', '9932a9fbec.mp4', '2018-10-28 13:36:02', '2018-10-28 13:42:36', NULL),
('83', '11', 'Ocean Deep', 'Life goes to extraordinary lengths to survive this immense realm. A 30 tonne whale shark gorges on a school of fish and the unique overhead heli-gimbal camera reveals common dolphins rocketing at more than 30km an hour.', '011', '2b55b2c11a.mp4', '2018-10-28 13:36:28', '2018-10-28 13:43:06', NULL),
('84', '12', 'Cities', 'Cities are growing at a faster rate than any other habitat on Earth. They may seem an unlikely place for animals to thrive, but for the bold this is a world of surprising opportunity. Leopards prowl the streets of Mumbai, peregrine falcons hunt amongst New Yorks skyscrapers and a million starlings perform spectacular aerial dances over Rome. We welcome some creatures into our cities; in Jodhpur langurs are revered as religious deities and in Harar locals live in harmony with wild hyenas. Many animals, however, are struggling to cope in the urban jungle. As the architects of this environment will we choose to build cities that create a home for both us and for wildlife?', '006', '3df403c711.mp4', '2018-10-29 01:18:18', '2018-10-29 01:18:18', NULL),
('85', '12', 'Grasslands', 'Grasslands cover one quarter of all land and support the greatest gatherings of wildlife on Earth. The extraordinary creatures that live here must survive the most hostile seasons on the planet. From bizarre looking Saiga antelope in Asia, rarely seen by humans, to the giant ant-eaters of Brazil, grassland animals show remarkable survival techniques. In the flooded Okavango, lions take on formidable buffalo in epic battles, stunning bee-eaters ride on the back of ostriches like miniature jockeys, while caribou embark on great migrations, where they must cross paths with their nemesis, Arctic wolves.', '005', '60be1ac26b.mp4', '2018-10-29 01:18:58', '2018-10-29 01:18:58', NULL),
('86', '12', 'Deserts', 'The worlds deserts force animals to come up with ingenious ways of coping with hostile conditions, giving rise to the most incredible survival stories on earth.', '004', 'e60bb9e638.mp4', '2018-10-29 01:19:36', '2018-10-29 01:19:36', NULL),
('87', '12', 'Jungles', 'A look at the animals competing to survive in the rich habitats of the planet\'s jungles.', '003', '4804e405b2.mp4', '2018-10-29 01:20:07', '2018-10-29 01:20:07', NULL),
('88', '12', 'Mountains', 'The great mountain ranges are some of the planet\'s most spectacular landscapes, but they are unforgiving places to live in, and only a few animals have what it takes to live at extreme altitude. Mountain animals are amongst the most elusive in the world, and this film provides unique and intimate glimpses into their secretive lives. Witness the moment four snow leopards come together when a mother and cub become trapped between two rival males. Join grizzly bears as they dance against trees to rub off their winter fur and soar with golden eagles hunting amongst Europe\'s snow-capped peaks.', '002', '5cdbb5a910.mp4', '2018-10-29 01:20:44', '2018-10-29 01:20:44', NULL),
('89', '12', 'Islands', 'Islands are wildlife sanctuaries, but surviving in isolation comes with extreme challenges.', '001', 'ab52a60a72.mp4', '2018-10-29 01:21:11', '2018-10-29 01:21:11', NULL),
('90', '13', 'Challenges of Life', 'In nature, living long enough to breed is a monumental struggle. Many animals and plants go to extremes to give themselves a chance. Uniquely, three brother cheetahs band together to bring down a huge ostrich. ', '001', '96c0965f69.mp4', '2018-10-29 08:28:39', '2018-10-29 08:28:39', NULL),
('91', '13', 'Fish', 'Fish dominate the planet\'s waters through their astonishing variety of shape and behaviour. The beautiful weedy sea dragon looks like a creature from a fairytale, and the male protects their eggs by carrying them on his tail for months.', '004', '2d74049737.mp4', '2018-10-29 08:29:05', '2018-10-29 08:40:08', NULL),
('92', '13', 'Birds', 'Birds owe their global success to feathers - something no other animal has. They allow birds to do extraordinary things.', '005', '4b8141fdd7.mp4', '2018-10-29 08:29:27', '2018-10-29 08:30:42', NULL),
('93', '13', 'Insects', 'There are 200 million insects for each of us. They are the most successful animal group ever. Their key is an armoured covering that takes on almost any shape. Darwin\'s stag beetle fights in the tree tops with huge curved jaws. ', '006', '632285f242.mp4', '2018-10-29 08:30:06', '2018-10-29 08:40:37', NULL),
('94', '13', 'Hunters and Hunted', 'Mammals\' ability to learn new tricks is the key to survival in the knife-edge world of hunters and hunted. In a TV first, a killer whale off the Falklands does something unique: it sneaks into a pool where elephant seal pups learn to swim.', '007', '4a2ccdf519.mp4', '2018-10-29 08:32:00', '2018-10-29 08:32:00', NULL),
('95', '13', 'Creatures of the Deep', 'Marine invertebrates are some of the most bizarre and beautiful animals on the planet, and thrive in the toughest parts of the oceans. Divers swim into a shoal of predatory Humboldt squid as they emerge from the ocean depths to hunt in packs.', '008', 'fd77013ac6.mp4', '2018-10-29 08:32:35', '2018-10-29 08:41:09', NULL),
('96', '13', 'Reptiles and Amphibians', 'Reptiles and amphibians look like hang-overs from the past. But they overcome their shortcomings through amazing innovation. The pebble toad turns into a rubber ball to roll and bounce from its enemies.', '002', 'ddd22b56f4.mp4', '2018-10-29 08:36:54', '2018-10-29 08:36:54', NULL),
('97', '13', 'Mammals', 'Mammals dominate the planet. They do it through having warm blood and by the care they lavish on their young.', '003', 'f01f54ec5b.mp4', '2018-10-29 08:37:38', '2018-10-29 08:37:38', NULL),
('98', '13', 'Plants', 'Plants\' solutions to life\'s challenges are as ingenious and manipulative as any animal\'s.\r\n', '009', 'f3fca08c40.mp4', '2018-10-29 08:38:38', '2018-10-29 08:38:38', NULL),
('99', '13', 'Primates', 'Intelligence and adaptability allow primates to tackle the many challenges of life, and this is what makes our closest relatives so successful. This resourcefulness has enabled primates to conquer an incredible diversity of habitat.', '010', '25f917aba1.mp4', '2018-10-29 08:39:01', '2018-10-29 08:39:01', NULL),
('100', '14', 'Pilot', 'Rick moves in with his daughter\'s family and establishes himself as a bad influence on his grandson, Morty.', '001', '99724c0456.mp4', '2018-10-29 12:05:58', '2018-10-29 12:05:58', NULL),
('101', '14', 'Lawnmower Dog', 'Rick and Morty try to incept Morty\'s math teacher into giving Morty an \'A\'.  Meanwhile, Rick gives Jerry a device to train their dog, Snuffles.', '002', '575a97391c.mp4', '2018-10-29 12:06:21', '2018-10-29 12:06:21', NULL),
('102', '14', 'Anatomy Park', 'Christmas day, Rick\'s friend, Reuben, comes over for his annual medical checkup.  Meanwhile Jerry learns his parents have a new friend.', '003', '69db0909cc.mp4', '2018-10-29 12:06:50', '2018-10-29 12:06:50', NULL),
('103', '14', 'M. Night Shaym-Aliens!', 'Rick and Morty try to get to the bottom of a mystery in this M. Night Shyamalan style twistaroony of an episode!', '004', '175a634bd1.mp4', '2018-10-29 12:07:10', '2018-10-29 12:07:10', NULL),
('104', '14', 'Meeseeks and Destroy', 'When Morty thinks Rick\'s adventures are too dangerous, he challenges Rick to let him lead one instead.', '005', '4a0b07ae63.mp4', '2018-10-29 12:07:30', '2018-10-29 12:07:30', NULL),
('105', '14', 'Rick Potion #9', 'Rick provides Morty with a love potion to get his dream girl, only for the serum to backfire and create a living Cronenberg nightmare.', '006', '178f39022e.mp4', '2018-10-29 12:07:59', '2018-10-29 12:07:59', NULL),
('106', '14', 'Raising Gazorpazorp', 'Morty convinces Rick to buy him a sexy robot.  Later Rick and Summer spend some quality time together.', '007', '7b5969bbe3.mp4', '2018-10-29 12:08:31', '2018-10-29 12:08:31', NULL),
('107', '14', 'Rixty Minutes', 'Rick hacks the cable box, but the family are distracted by another one of his inventions.', '008', '2cf9f0362c.mp4', '2018-10-29 12:09:36', '2018-10-29 12:09:36', NULL),
