('109', '14', 'Close Rick-Counters of the Rick Kind', 'Rick and Morty have a falling out when Rick is approached by some familiar associates.', '010', '849901aa33.mp4', '2018-10-29 12:10:37', '2018-10-29 12:10:37', NULL),
('110', '14', 'Ricksy Business', 'Beth and Jerry go away on a trip, so Rick decides to throw a party.', '011', '1b883d9b11.mp4', '2018-10-29 12:11:01', '2018-10-29 12:11:01', NULL),
('111', '15', 'A Rickle in Time', 'Rick, Morty, and Summer get into trouble when time is fractured by a feedback loop of uncertainty that split reality into more than one equally possible impossibilities.', '001', '6c9c7ee53a.mp4', '2018-10-29 12:12:22', '2018-10-29 12:12:22', NULL),
('112', '15', 'Mortynight Run', 'Rick teaches Morty to drive while leaving Jerry at a popular day care made just for him. Morty\'s conscience has him hunt down an assassin rather than spending the day at an alien arcade.', '002', 'f207a78abc.mp4', '2018-10-29 12:12:43', '2018-10-29 12:12:43', NULL),
('113', '15', 'Auto Erotic Assimilation', 'Rick gets emotionally invested when meeting an old friend, while Beth and Jerry have a falling out after making a discovery under the garage.', '003', 'fb6d2611d5.mp4', '2018-10-29 12:13:05', '2018-10-29 12:13:05', NULL),
('114', '15', 'Total Rickall', 'Trapped inside the house with an ever-increasing number of parasitic alien shape-shifters capable of altering memories, an uncertain Rick and the Smiths search for a way to determine which of them are real.', '004', '11489db2fa.mp4', '2018-10-29 12:14:03', '2018-10-29 12:14:03', NULL),
('115', '15', 'Get Schwifty', 'When a massive head descends into Earth\'s atmosphere, Rick and Morty must save the planet by coming up with a new hit song. Meanwhile, Jerry, Beth, and Summer become part of a new religion.', '005', '033fa07da5.mp4', '2018-10-29 12:14:30', '2018-10-29 12:14:30', NULL),
('116', '15', 'The Ricks Must Be Crazy', 'Rick and Morty travel inside the car\'s battery, where Morty discovers Rick has created a universe containing sentient life solely to produce power for him. Meanwhile, Summer must deal with being locked in the car with Rick\'s overzealous security system.', '006', 'c4ebe7c29b.mp4', '2018-10-29 12:15:02', '2018-10-29 12:15:02', NULL),
('117', '15', 'Big Trouble in Little Sanchez', 'Rick joins in on hijinks while Beth and Jerry sort out relationship issues.', '007', '95153a60e0.mp4', '2018-10-29 12:15:36', '2018-10-29 12:15:36', NULL),
