('454', '47', 'Madagascar (2005)', 'Alex the lion is the king of the urban jungle, the main attraction at New Yorks Central Park Zoo. He and his best friendsMarty the zebra, Melman the giraffe and Gloria the hippohave spent their whole lives in blissful captivity before an admiring public and with regular meals provided for them. Not content to leave well enough alone, Marty lets his curiosity get the better of him and makes his escapewith the help of some prodigious penguinsto explore the world.', '001', 'd9de64b3e5.mp4', '2019-01-30 08:08:12', '2019-01-30 08:11:17', NULL),
('455', '47', 'Madagascar: Escape 2 Africa', 'Alex, Marty, and other zoo animals find a way to escape from Madagascar when the penguins reassemble a wrecked airplane. The precariously repaired craft stays airborne just long enough to make it to the African continent. There the New Yorkers encounter members of their own species for the first time. Africa proves to be a wild place, but Alex and company wonder if it is better than their Central Park home.', '002', '9a3a3dd158.mp4', '2019-01-30 08:08:52', '2019-01-30 08:11:32', NULL),
('456', '47', 'Madagascar 3: Europe\'s Most Wanted', 'Animal pals Alex, Marty, Melman, and Gloria are still trying to make it back to New York\'s Central Park Zoo. They are forced to take a detour to Europe to find the penguins and chimps who broke the bank at a Monte Carlo casino. When French animal-control officer Capitaine Chantel DuBois picks up their scent, Alex and company are forced to hide out in a traveling circus.', '003', 'b2426d520b.mp4', '2019-01-30 08:09:24', '2019-01-30 08:11:45', NULL),
