('538', '55', 'Do You Like Broccoli Ice Cream', 'Lyrics:\r\nDo you like broccoli?\r\nYes, I do!\r\nDo you like ice cream? \r\nYes, I do! \r\nDo you like broccoli ice cream?\r\nNo, I don\'t. Yucky!\r\n\r\nDo you like donuts? \r\nYes, I do!\r\nDo you like juice? \r\nYes, I do!\r\nDo you like donut juice? \r\nNo, I don\'t. Yucky!\r\n\r\nDo you like popcorn? \r\nYes, I do!\r\nDo you like pizza? \r\nYes, I do!\r\nDo you like popcorn pizza? \r\nNo, I don\'t. Yucky!\r\n\r\nDo you like bananas?\r\nYes, I do!\r\nDo you like soup?\r\nYes, I do!\r\nDo you like banana soup? \r\nNo, I don\'t. Yucky! ', '001', '62394c3beb.mp4', '2019-03-07 12:57:27', '2019-03-07 12:57:27', NULL),
('539', '55', 'Do You Like Lasagna Milkshakes  Ice Cream and Lasagna!', 'Lyrics: \r\nDo you like lasagna?\r\nYes, I do! Yes, I do!\r\nDo you like milkshakes?\r\nYes, I do! Yes, I do!\r\nDo you like lasagna milkshakes?\r\nNo, I dont! Yucky!\r\n\r\nDo you like avocados?\r\nYes, I do! Yes, I do!\r\nDo you like lollipops?\r\nYes, I do! Yes, I do!\r\nDo you like avocado lollipops?\r\nNo, I dont! Yucky!\r\n\r\nDo you like asparagus?\r\nYes, I do! Yes, I do!\r\nDo you like cake?\r\nYes, I do! Yes, I do!\r\nDo you like asparagus cake?\r\nNo, I dont! Yucky!\r\n\r\nDo you like peanut butter?\r\nYes, I do! Yes, I do!\r\nDo you like jelly?\r\nYes, I do! Yes, I do!\r\nDo you like peanut butter and jelly?\r\nYes, I do. Yummy!', '002', '56f973fc72.mp4', '2019-03-07 12:58:42', '2019-03-07 12:58:42', NULL),
