('688', '47', 'Pokmon Detective Pikachu', 'Ace detective Harry Goodman goes mysteriously missing, prompting his 21-year-old son, Tim, to find out what happened. Aiding in the investigation is Harry\'s former Pokmon partner, wise-cracking, adorable super-sleuth Detective Pikachu. Finding that they are uniquely equipped to work together, as Tim is the only human who can talk with Pikachu, they join forces to unravel the tangled mystery.', '6', 'a4cf284dfd.mp4', '2019-07-27 15:17:14', '2019-07-27 15:17:14', NULL),
('689', '47', 'The Queen\'s Corgi', 'When the Queen\'s favourite dog, Rex, becomes lost, he must make new friends and embrace new adventures in order to find his way back to the palace.', '7', 'cf8086e2e7.mp4', '2019-07-27 15:18:30', '2019-07-27 15:18:30', NULL),
