INSERT INTO `lesson_objectives` (`id`, `lesson_id`, `rank`, `objective`, `reasoning`, `created_at`, `updated_at`, `deleted_at`) VALUES ('1', '15', '1', 'Correctly pronounce the seven days of the week. ', 'this is a good reason huh. ', '2018-10-19 05:11:28', '2018-10-19 05:25:50', NULL),
('2', '15', '2', 'Name the days of the week with a response time of 3 seconds or less.', 'Responce time will make the experience more natural. ', '2018-10-19 05:29:41', '2018-10-19 05:29:41', NULL),
('3', '18', '1', 'Be able to give a clear step by step explanation of how the water cycle works. ', 'The learner should have a clear understanding of how the water cycle work.', '2018-10-30 23:08:26', '2018-10-30 23:08:26', NULL),
('4', '18', '2', 'Be able to explain how the water cycle helps us clean and desalinate water. ', 'The water cycle is one of the most critical systems of the earth. We need to understand why it is so important to our existence. ', '2018-10-30 23:11:44', '2018-10-31 01:51:58', NULL),
('5', '19', '1', 'Able to explain what a material is. ', 'Define the word material. ', '2018-10-31 03:50:20', '2018-10-31 03:50:20', NULL),
('6', '19', '2', 'Be able to name the different materials with a response time of 3 seconds. ', 'Students should be able to retain material names with a high level o accuracy. ', '2018-10-31 03:51:34', '2018-10-31 03:51:34', NULL),
('7', '17', '2', 'Name all the 8 planets of the solar system in the right order. ', 'The order of the planets is important. ', '2018-10-31 14:30:44', '2018-10-31 14:30:44', NULL),
('8', '17', '1', 'Be able to say what is and what isn\'t a planet. ', 'Develop the understanding of the collective word and its instances. ', '2018-10-31 14:32:03', '2018-10-31 14:32:47', NULL),
('9', '40', '1', 'be able to correctly derive what day yesterday or tomorrow was for any given present day. ', 'Learners should be able functionally use these concepts. ', '2018-11-03 06:11:58', '2018-11-03 06:11:58', NULL),
('10', '41', '1', 'Be able to name the layers of the atmosphere in the right order, starting from the earth out to space. ', 'The order in important when considering what part of the atmosphere is transitioning into what part. ', '2018-11-06 06:59:12', '2018-11-06 06:59:12', NULL),
('11', '42', '1', 'learn to produce the sounds of the numbers in any order. ', 'Student should start to recognise the sounds of the words. ', '2018-11-09 13:46:07', '2018-11-09 13:46:07', NULL),
('12', '42', '2', 'Be able to count to 20.', 'The student should be able to count up to 20. ', '2018-11-09 13:46:55', '2018-11-09 13:46:55', NULL),
('13', '43', '001', 'Understand the fundamental principals of gravity. ', '', '2018-11-13 06:37:29', '2018-11-13 06:37:29', NULL),
('14', '43', '002', 'Be able to explain and reason the effects of gravity. ', '', '2018-11-13 06:37:57', '2018-11-13 06:37:57', NULL),
('15', '44', '001', 'Be able to produce the letter names with adequate pronunciation. ', '', '2018-11-16 14:49:18', '2018-11-16 14:49:18', NULL),
('16', '34', '001', 'Learn the names of the different shapes.', '', '2018-12-07 08:08:26', '2018-12-07 08:08:26', NULL),
('17', '34', '002', 'Learn to describe the shapes in terms of pairs of equal angles and sides.', '', '2018-12-07 08:09:38', '2018-12-07 08:09:38', NULL),
('18', '48', '1', 'Learn the names of at least 10 asian countries. ', 'Learn to pronounce their names. ', '2018-12-14 13:08:18', '2018-12-14 13:08:18', NULL),
('19', '49', '001', 'Learn the names of the five big oceans.', 'Because learners need to be able to recognise these names when referenced in preceding classes.  ', '2018-12-15 11:39:29', '2018-12-15 11:39:29', NULL),
('20', '49', '002', 'Be able to mention some facts about these oceans', 'Because learners should link substance to this knowledge in order to retain it. ', '2018-12-15 11:40:49', '2018-12-15 11:40:49', NULL),
('21', '16', '1', 'Learn the names of the twelve months of the year in the right order. ', 'To be able to recall the correct position of the corresponding month. ', '2018-12-17 12:55:42', '2018-12-17 12:55:42', NULL),
('22', '16', '2', 'Be able to randomly name the months of the year. ', 'To ensure speedy response time when having a conversation. ', '2018-12-17 12:57:14', '2018-12-17 12:57:14', NULL),
('23', '52', '1', 'Describe people their appearance. ', '', '2018-12-30 03:17:57', '2018-12-30 03:17:57', NULL),
('24', '53', '001', 'Learn the names of the four seasons', 'Learn to pronounce the names of the four seasons for easy recollection. ', '2018-12-30 15:06:29', '2018-12-30 15:06:29', NULL),
('25', '54', '001', 'Learn how to pronounce and say the words taught in the lesson. ', 'Learn how to say these words clearly.', '2018-12-31 01:51:12', '2018-12-31 01:51:12', NULL),
('26', '54', '002', 'Know the relationship between seconds, minutes, and hours.', 'The precursor for unit conversion.', '2018-12-31 01:52:45', '2018-12-31 01:52:45', NULL),
('27', '46', '1', 'Learn about how living things communicate.', 'Broaden the understanding of children on this topic.', '2019-03-02 02:46:01', '2019-03-02 02:46:01', NULL),
('28', '39', '1', 'Learn how we sense the world.', 'Make students aware of how they experience the world through their brain. ', '2019-03-04 03:45:48', '2019-03-04 03:45:48', NULL),
('29', '21', '', 'The Singing Walrus presents the colors song \"Rainbow Colors\", a fun, upbeat rock song that teaches children the 7 colors of the rainbow. Join our characters for a fun adventure across land and sea to find all of the colors - red, orange, yellow, green, blue, purple and pink!', '', '2019-03-07 01:24:17', '2019-03-07 01:24:17', NULL);
INSERT INTO `lesson_questions` (`id`, `lesson_id`, `rank`, `question`, `answer`, `created_at`, `updated_at`, `deleted_at`) VALUES ('1', '15', '1', 'How many days are there in a week?', 'There are seven days in a week. ', '2018-10-19 04:23:54', '2018-10-19 04:42:55', NULL),
('2', '15', '2', 'What are the seven days of the week ?', 'The seven days of the week are: Monday, Tuesday, Wednesday, Thursday, Friday, Saturday, Sunday.', '2018-10-19 04:44:03', '2018-10-19 04:44:03', NULL),
('3', '15', '3', 'What is the first day of the week?', 'The first day of the week is Monday.', '2018-10-19 04:44:44', '2018-10-19 04:44:44', NULL),
('4', '15', '4', 'What is the second day of the week?', 'The second day of the week is Tuesday. ', '2018-10-19 04:45:19', '2018-10-19 04:45:19', NULL),
('5', '18', '1', 'What is humidity?', 'humidity is a quantity representing the amount of water vapor in the atmosphere or in a gas.', '2018-10-31 00:03:27', '2018-10-31 00:03:27', NULL),
('6', '18', '2', 'What is another name for the water cycle?', 'The hydrological cycle or the hydrologic cycle.', '2018-10-31 00:04:20', '2018-10-31 00:04:20', NULL),
('7', '18', '3', 'What is the meaning of desalination?', 'Desalination is the process of removing salt from seawater.', '2018-10-31 00:05:04', '2018-10-31 00:05:04', NULL),
('8', '18', '4', 'What is equilibrium?', 'Equilibrium is state in which opposing forces or influences are balanced.', '2018-10-31 00:08:09', '2018-10-31 00:08:09', NULL),
('9', '18', '5', 'What is a side effect?', 'A side effect is a secondary, typically undesirable effect of a drug, medical treatment or other process. ', '2018-10-31 00:09:46', '2018-10-31 00:10:38', NULL),
('10', '19', '1', 'Is a glass hammer sturdy?', 'No, it\'s fragile.', '2018-10-31 11:04:00', '2018-10-31 11:12:19', NULL),
('11', '19', '2', 'is a paper chair fragile?', 'Yes, it is.', '2018-10-31 11:04:30', '2018-10-31 11:04:30', NULL),
('12', '19', '3', 'is a glass door sturdy?', 'No, It\'s fragile. ', '2018-10-31 11:05:29', '2018-10-31 11:05:46', NULL),
('13', '19', '4', 'What is heavier? a plastic bag, or a metal door knob. ', 'A metal door knob is heavier. ', '2018-10-31 11:07:32', '2018-10-31 11:08:31', NULL),
('14', '19', '5', 'What is lighter a brick or a piece of paper?', 'The piece of paper is lighter. ', '2018-10-31 11:08:13', '2018-10-31 11:09:00', NULL),
('15', '16', '1', 'How many months are there in a year?', 'There are twelve months in a year. ', '2018-11-02 08:29:45', '2018-11-02 08:29:45', NULL),
('16', '16', '2', 'What are the months of the year?', 'The months of the year are: January, February, March, April, May, June, Jully, August, September, October, November, December', '2018-11-02 08:45:37', '2018-11-02 08:45:37', NULL),
('17', '16', '5', 'What is the first month of the year?', 'The first month of the year is January.', '2018-11-02 08:46:26', '2018-11-02 08:46:26', NULL),
('18', '16', '3', 'How may days are in a year?', 'There are 365 days in a year. ', '2018-11-02 08:47:01', '2018-11-02 08:47:01', NULL),
('19', '16', '4', 'What do we call a year with 366 days?', 'A leap year.', '2018-11-02 08:47:47', '2018-11-02 08:47:47', NULL),
('20', '16', '6', 'Which month gets one extra day (intercalary) in a leap year?', 'February gets an extra day (intercalary) in a leap year. ', '2018-11-02 08:49:18', '2018-11-02 08:52:19', NULL),
('21', '16', '7', 'Which months have 30 days?', 'April, June, September and November have 30 days. ', '2018-11-02 08:49:59', '2018-11-02 08:49:59', NULL),
('22', '16', '8', 'Which months have 31 days?', 'January, March, May, Jully, August, October, December all have 31 days. ', '2018-11-02 08:50:42', '2018-11-02 08:50:42', NULL),
('23', '16', '9', 'How many days does February have?', 'February has 28 days. ', '2018-11-02 08:51:22', '2018-11-02 08:51:22', NULL),
('24', '16', '10', 'How many days does February have when it\'s a leap year?', 'It has 29 days. ', '2018-11-02 08:52:05', '2018-11-02 08:52:05', NULL),
('25', '42', '1', 'How many eyes do you have?', 'I have two eyes. ', '2018-11-09 14:01:08', '2018-11-09 14:01:08', NULL),
('26', '42', '2', 'How many ears do you have?', 'I have two ears. ', '2018-11-09 14:01:33', '2018-11-09 14:01:33', NULL),
('27', '42', '3', 'How many fingers do you have?', 'I have ten fingers. ', '2018-11-09 14:03:49', '2018-11-09 14:03:49', NULL),
('28', '42', '4', 'How many hands do you have?', 'I have two hands. ', '2018-11-09 14:04:11', '2018-11-09 14:04:11', NULL),
('29', '42', '5', 'How many legs do you have?', 'I have two legs.', '2018-11-09 14:04:47', '2018-11-09 14:04:47', NULL),
('30', '42', '6', 'How many toes do you have?', 'I have ten toes. ', '2018-11-09 14:05:16', '2018-11-09 14:05:16', NULL),
('31', '42', '7', 'How many mothers do you have?', 'I have one mother. ', '2018-11-09 14:05:44', '2018-11-09 14:05:44', NULL),
('32', '42', '9', 'How many fathers do you have?', 'I have one father. ', '2018-11-09 14:06:08', '2018-11-09 14:06:08', NULL),
('33', '42', '10', 'How many thumbs do you have?', 'I have two thumbs. ', '2018-11-09 14:06:34', '2018-11-09 14:06:34', NULL),
('34', '48', '001', 'How many countries are in Asia?', 'There are 48 countries in Asia.', '2018-12-14 13:50:47', '2018-12-14 13:50:47', NULL),
('35', '48', '002', 'What is the largest country in Asia?', 'Russia is the largest country in Asia.', '2018-12-14 13:52:25', '2018-12-14 13:52:25', NULL),
('36', '48', '003', 'What is the second largest country in Asia?', 'China is the second largest country in Asia.', '2018-12-14 13:53:18', '2018-12-14 13:53:18', NULL),
('37', '48', '005', 'What is the smallest country in Asia?', 'Maldive is the smallest country in Asia. ', '2018-12-14 13:54:06', '2018-12-14 13:55:56', NULL),
('38', '48', '006', 'What is the second smallest country in Asia?', 'Singapore is the second smallest country in Asia. ', '2018-12-14 13:56:57', '2018-12-14 13:56:57', NULL),
('39', '49', '001', 'What is the biggest Ocean?', 'The Pacific Ocean is the biggest ocean.', '2018-12-15 11:53:34', '2018-12-15 11:54:10', NULL),
('40', '49', '002', 'What is the smallest ocean?', 'The smallest ocean is the Arctic ocean.', '2018-12-15 11:55:37', '2018-12-15 11:55:37', NULL),
('41', '53', '001', 'How many seasons are in a year?', 'There are 4 seasons in a year.', '2018-12-30 15:57:49', '2018-12-30 15:57:49', NULL),
('42', '53', '002', 'What are the four seasons of the year?', 'They are, winter, spring, summer, fall. ', '2018-12-30 15:59:41', '2018-12-30 15:59:41', NULL),
('43', '53', '003', 'During what season do flowers bloom?', 'Flowers bloom during spring.', '2018-12-30 16:02:03', '2018-12-30 16:02:03', NULL),
('44', '53', '004', 'During what season do leaves fall?', 'Leaves fall during fall. ', '2018-12-30 16:03:16', '2018-12-30 16:03:16', NULL),
('45', '54', '002', 'How many seconds are in a minute?', 'There are 60 seconds in a minute.', '2018-12-31 00:41:13', '2018-12-31 00:41:13', NULL),
('46', '54', '002', 'How many minutes are in an hour?', 'There are 60 seconds in an hour.', '2018-12-31 00:42:41', '2018-12-31 00:42:41', NULL),
('47', '54', '003', 'How many hours are in a day?', 'There are 24 hours in a day.', '2018-12-31 00:43:28', '2018-12-31 00:43:28', NULL),
('48', '46', '01', 'What is communication?', 'Communication is sharing information stored either inside or outside your body with others.', '2019-03-02 03:27:54', '2019-03-02 03:27:54', NULL),
('49', '46', '02', 'How do living things communicate?', 'They communicate through: (1)sound, (2) gestures, (3)chemical(smell), (4)images.', '2019-03-02 03:28:26', '2019-03-02 03:30:17', NULL),
('50', '46', '01', 'How can we communicate faster?', 'We communicate faster by using a language.', '2019-03-02 03:31:33', '2019-03-02 03:31:33', NULL),
('51', '46', '04', 'How do deaf people communicate?', 'They use sign language. ', '2019-03-02 03:32:49', '2019-03-02 03:32:49', NULL),
('52', '46', '05', 'How do blind people communicate?', 'They use braille.', '2019-03-02 03:33:02', '2019-03-02 03:33:42', NULL),
('53', '39', '001', 'What organ helps us see things?', 'Our eyes.', '2019-03-04 04:10:57', '2019-03-29 06:54:10', NULL),
('54', '39', '002', 'What organ helps us hear things?', 'Our ears. ', '2019-03-04 04:11:23', '2019-03-04 04:11:23', NULL),
('55', '39', '03', 'What organ helps us smell things?', 'Our nose. ', '2019-03-04 04:11:51', '2019-03-04 04:11:51', NULL),
('56', '39', '05', 'What organ helps us taste things?', 'Our tongue. ', '2019-03-04 04:12:32', '2019-03-04 04:12:32', NULL),
('57', '39', '04', 'What organ helps us feel things?', 'Our skin.', '2019-03-04 04:12:57', '2019-03-04 04:13:12', NULL),
('58', '39', '06', 'What do you call someone who can not see?', 'They are called blind. ', '2019-03-04 04:14:02', '2019-03-04 04:14:02', NULL),
('59', '39', '07', 'What do you call someone who can not hear?', 'They are called deaf. ', '2019-03-04 04:14:44', '2019-03-04 04:14:44', NULL);
