('22', '18', '1', 'Water Cycle Song', 'fb6576e390.mp4', 'Water Cycle Song Lyrics: \r\n\r\nThe Water Cycle\r\nTakes the water and moves it\r\nUp and Down and all around the Earth\r\n\r\nEvaporation comes\r\nWhen the heat from the Sun\r\nWarms up all the groundwater\r\nThen it turns to water vapor\r\n\r\nCondensation takes over\r\nIt goes up to the clouds\r\nWater vapor cools down\r\nAnd it changes to a liquid, now\r\n\r\nPrecipitation happens\r\nWhen the drops get big\r\nIt falls like Rain, Snow, Sleet, and Hail upon my head\r\nI know it\'s the water cycle happening again\r\nEvaporation, Condensation, Precipitation', 'video/mp4', NULL, '2018-10-31 01:03:39', '2018-10-31 01:03:39', NULL),
('23', '18', '2', 'The water cycle Ecology Khan Academy', '8ee2351091.mp4', 'Ecology on Khan Academy: Why are polar bears found only in the Arctic? Why does mildew grow in your shower and not (hopefully) in your sock drawer? Learn how ecologists study the interactions between organisms and their environment, and how these interactions affect where, and in what numbers, different types of organisms are found.', 'video/mp4', NULL, '2018-10-31 01:05:11', '2018-10-31 01:05:11', NULL),
('24', '18', '3', 'The Water Cycle ( National Science Foundation)', '920eb420cb.mp4', 'This video uses animation, graphics, and video clips to illustrate and explain each of the \"flow\" and \"storage\" processes in the Hydrologic Cycle, more commonly known as the Water Cycle:  precipitation, interception, runoff, infiltration, percolation, groundwater discharge, evaporation, transpiration, evapotranspiration, and condensation.', 'video/mp4', NULL, '2018-10-31 01:08:33', '2018-10-31 01:08:33', NULL),
('25', '18', '4', 'Earth\'s Water Cycle (NASA)', 'f0a216510b.mp4', 'Water is the fundamental ingredient for life on Earth. Looking at our Earth from space, with its vast and deep ocean, it appears as though there is an abundance of water for our use. However, only a small portion of Earth\'s water is accessible for our needs. How much fresh water exists and where it is stored affects us all. This animation uses Earth science data from a variety of sensors on NASA Earth observing satellites as well as cartoons to describe Earth\'s water cycle and the continuous movement of water on, above and below the surface of the Earth.', 'video/mp4', NULL, '2018-10-31 01:10:30', '2018-10-31 01:10:30', NULL),
('26', '19', '1', 'Everything\'s Material Song', '6f2c9fe7f1.mp4', 'Everything is material. Everything we see, from rocks plants or animals, or from a factory. ', 'video/mp4', NULL, '2018-10-31 14:09:44', '2018-10-31 14:09:44', NULL),
