('45', '40', '1', 'It never ends (StoryBots)', '825f4d9664.mp4', 'One day ago was yesterday\r\nYeah, it\'s over now, but that\'s okay, \'cause\r\n\r\nToday is now, yeah it\'s happening\r\nFor example, today, you\'re hearing me sing\r\n\r\nTomorrow is just one day ahead\r\nYou look forward to it each night when you go to bed\r\n\r\nToday, today\r\nThis day is today\r\nAnd yesterday was one day ago\r\nToday, Today,\r\nAnd after today\r\nIs the day that we call tomorrow\r\n\r\nToday, today\r\nThis day is today\r\nAnd yesterday was one day ago\r\nToday, Today,\r\nAnd after today\r\nIs the day that we call tomorrow\r\n\r\nLet\'s sing it again tomorrow!', 'video/mp4', NULL, '2018-11-03 06:24:08', '2018-11-03 06:24:08', NULL),
