('47', '40', '3', 'TODAY IS, YESTERDAY WAS, TOMORROW IS ', '7cbdf920e4.mp4', 'Learn the 7 days of the week and the phrases TODAY IS, YESTERDAY WAS, & TOMORROW IS! Learn the days of the week in English with these three key phrases to help your child understand time and the difference between Yesterday, Today, and Tomorrow. We hope you enjoy learning about the 7 days of the week and the phrases today is, yesterday was, and tomorrow is in English for kids! ', 'video/mp4', NULL, '2018-11-04 13:21:06', '2018-11-04 13:21:06', NULL),
('48', '42', '1', 'Funky Counting Song (Numbers 1-10)', 'f36c647d87.mp4', 'Here is another basic counting song for young learners that engages both body and mind! \r\n\r\nYour kids get to count from 1 to 10 three times (first slow, then a little faster) while following the little chick\'s dance steps. This song will provide a quick moment of exercise and relaxation for your kids (and you ', 'video/mp4', NULL, '2018-11-09 08:30:44', '2018-11-09 08:46:35', NULL),
('49', '42', '2', 'Counting 1-10 Song', 'e9f562f0d8.mp4', 'The Singing Walrus team is excited to present \"Counting from 1 to 10\", the first numbers song of a series dedicated to toddlers and preschool / kindergarten kids, or young ESL students! \"Counting from 1-10\" makes it easy for children to learn numbers and basic counting skills - and the tune is very catchy :) ', 'video/mp4', NULL, '2018-11-09 08:41:26', '2018-11-09 08:46:03', NULL),
('50', '42', '3', 'Counting Together ', 'f9b0f9dda3.mp4', 'Counting together to ten is easy. One, two, three, four, five, six, seven, eight, nine, ten.\r\nCounting together to see how many.\r\nCounting together, lets count some blocks. One, two, three, four, five, six, seven, eight, nine, ten.\r\nCounting together, how many fingers?\r\nCounting together, lets count them all. One, two, three, four, five, six, seven, eight, nine, ten.\r\nCounting together, lets march in time now.\r\nCounting together, lets count our steps. One, two, three, four, five, six, seven, eight, nine, ten.\r\nCounting together, hold up your feet.\r\nCounting together, and count your toes. One, two, three, four, five, six, seven, eight, nine, ten.\r\nCounting together, how many children?\r\nCounting together, well start with you. One, two, three, four, five, six, seven, eight, nine, ten, eleven, twelve, thirteen, fourteen, fifteen, sixteen. \r\nIs there really that many children here? \r\nCount them, Don.\r\nCounting backwards, prepare for blastoff.  Ten, nine, eight, seven, six, five, four, three, two, one.\r\nBLASTOFF!', 'video/mp4', NULL, '2018-11-09 08:51:02', '2018-11-09 08:51:02', NULL),
('51', '42', '4', 'Counting 1 to 10 (Number Songs)', '70a4c94e42.mp4', 'You are watching \"1 to 10 Penguins,\" a super fun number song created by PINKFONG. Let\'s sing with ten little penguins and learn to count 1 to 10! ', 'video/mp4', NULL, '2018-11-09 08:54:06', '2018-11-09 08:54:06', NULL),
('52', '42', '5', 'Count to 20 Super Simple Songs', '1612e7baea.mp4', 'We love counting! Counting down. Counting up. Counting to 5. Counting to 20. Counting  potatoes. Counting bananas. Counting teddy bears. Counting monkeys. This is a collection of ten of our favorite counting songs. Let\'s get started with some counting!', 'video/mp4', NULL, '2018-11-09 08:57:55', '2018-11-09 08:57:55', NULL),
('53', '42', '6', 'Number song 1-20 for children', '9ec4659fa5.mp4', 'The Singing Walrus presents \"Number song 1-20 for children\" - an upbeat chant that helps kids count the numbers 1-20. The kids all count from 1-20 together three times, each time counting faster than the previous. This is perfect for preschool aged children, and for young learners of ESL and EFL!', 'video/mp4', NULL, '2018-11-09 09:00:05', '2018-11-09 09:00:05', NULL),
('54', '42', '7', 'Let\'s Count From 10 - 20', '56d7f2d6df.mp4', 'The Singing Walrus presents \"Let\'s Count From 10 - 20\", the second numbers song of a series dedicated to preschool and kindergarten kids, or young ESL students. ', 'video/mp4', NULL, '2018-11-09 09:01:31', '2018-11-09 09:01:31', NULL),
('55', '42', '8', 'One Potato, Two Potatoes', 'ac7b75df87.mp4', 'One potato, two potatoes, three potatoes, four. Five potatoes, six potatoes, seven potatoes, more! Let\'s see what the potatoes do for fun in this Super Simple version of the classic \"One Potato, Two Potato\" choosing rhyme. ', 'video/mp4', NULL, '2018-11-09 09:02:38', '2018-11-09 09:02:38', NULL),
('56', '42', '9', 'Jelly Beans Counting Song', 'aeade914c2.mp4', 'You are watching \"Counting 1 to 20,\" a super fun number song created by PINKFONG. Let\'s sing with twenty tiny jelly beans and learn to count 1 to 20! ', 'video/mp4', NULL, '2018-11-09 09:05:12', '2018-11-09 09:05:12', NULL),
