('58', '42', '11', 'Count Down From 20 to 1 ', 'b30afc4c48.mp4', 'Let\'s count backwards from 20! Try marching, jumping, or hopping around the room as you sing along. It\'s the perfect song to ring in the New Year! ', 'video/mp4', NULL, '2018-11-09 09:12:52', '2018-11-09 09:12:52', NULL),
('59', '16', '2', 'The Months Chant', '67191476fe.mp4', ' January (January!)\r\nFebruary (February!)\r\nMarch (March!)\r\nApril (April!)\r\nMay (May!)\r\nJune (June!)\r\nJuly (July!)\r\nAugust (August!)\r\nSeptember (September!)\r\nOctober (October!)\r\nNovember (November!)\r\nDecember (December!)\r\n\r\nNow you try!\r\n', 'video/mp4', NULL, '2018-11-12 12:37:29', '2018-11-12 12:37:29', NULL),
('60', '16', '3', 'Time Twelve Months of the Year', '6af041dd9b.mp4', 'January,\r\nFebruary, March\r\nApril, May, June & July\r\nAugust, September\r\nOctober, November\r\nDecember and the year\'s gone by\r\n\r\nMonths remind me of birds sometimes,\r\nThe way they just fly by\r\nOne year has twelve of these little guys\r\nYou can name them if you try\r\nSo all you\'ve got to do is lend an ear,\r\nAnd we\'ll sing those twelve months of the year, they go\r\n\r\nJanuary,\r\nFebruary, March\r\nApril, May, June & July\r\nAugust, September\r\nOctober, November\r\nDecember and the year\'s gone by\r\n\r\nJanuary,\r\nFebruary, March\r\nApril, May, June & July\r\nAugust, September\r\nOctober, November\r\nDecember and the year\'s gone by\r\nYou can kiss that little year goodbye!', 'video/mp4', NULL, '2018-11-12 12:38:41', '2018-11-12 12:38:41', NULL),
('61', '16', '4', 'The Months of the Year Song', '0f411b4e81.mp4', 'From January to December there are 12 Months to remember!  Practice learning the months of the year with Scratch Garden\'s original song and video. ', 'video/mp4', NULL, '2018-11-12 12:40:06', '2018-11-12 12:40:06', NULL),
('62', '16', '5', 'Months In A Year Chant for Kids', '7d87a9cca0.mp4', 'Many of our videos work well with special needs children, especially those with Autistic Disorder, Speech and Language Impairments and Speech, Reading and Learning Disabilities.  We often receive emails from parents thanking us for helping their child learn to speak or read and each time it makes our day!  \r\n', 'video/mp4', NULL, '2018-11-12 12:41:14', '2018-11-12 12:41:14', NULL),
('63', '16', '6', 'Months of the Year Song 2', 'f856320263.mp4', 'Here is our \"Months of the Year Song\" - a fun folk song to help kids learn all 12 months of the year. Mother Hen sings the first verse alone so the kids can become familiar with the melody. During the 2nd verse, the kids sing along with Mother Hen. During the 3rd and 4th verses, both the kids and Mother Hen sing quietly and then loudly. In the final verse, the song speeds up to give the kids a fun challenge.', 'video/mp4', NULL, '2018-11-12 12:43:16', '2018-11-12 12:43:16', NULL),
('64', '16', '7', 'Moths Of The Years Song', 'fadaf1b81c.mp4', 'Thirty days hath September, April, June, and November; all the rest have thirty-one, except for February alone.', 'video/mp4', NULL, '2018-11-12 12:45:44', '2018-11-12 12:45:44', NULL),
('65', '16', '8', 'Time Song Months of the Year and Days in A Month', 'b374ad1e5b.mp4', 'We know that theres 1 minute\r\nIf we can fit 60 seconds in it.\r\n\r\nIf we could stack minutes and build a tower,\r\nThere would be 60 minutes in 1 hour.\r\n\r\nWhen 12 hours pass, then were halfway\r\nTo 24 hours, which makes a day.\r\n\r\nAnd a week is complete in 7 days,\r\nBut the length of a month is harder to say.\r\n\r\nThey can be 28 to 31 days long;\r\nOne of them contains the day that you were born on!\r\n\r\nJanuary, March, May, July, August, October, December:\r\nAll have 31 days; all have 31 days.\r\n\r\nApril, June, September, and November:\r\nAll have 30 days; all have 30 days.\r\n\r\nFebruary has 28 days, but when its a leap year,\r\nIts got 29 days; its got 29 days.\r\n\r\nThe length of a year is hard to make clear,\r\ncause one of every four years is a leap year.\r\n\r\nThe common years happen three in a row\r\nThey have 365 days, you know.\r\n\r\nThen a leap year comes with an intercalary,\r\nThats the name of the extra day in February.\r\n\r\nThats why leap years have 366 days\r\nAnd why Februarys number of days can change.\r\n\r\nREPEAT CHORUS\r\n\r\n10 years is a decade,\r\n100 years is a century,\r\nAnd a millenniums 1000 of history!', 'video/mp4', NULL, '2018-11-12 12:47:04', '2018-11-12 12:47:04', NULL),
('66', '41', '1', 'All you need to know about the earth\'s atmosphere. ', '9f68ac0622.mp4', 'A small animation about the layers of Earth\'s atmosphere. Focused on the 4th grade California educational standards. The script was written by the non-profit  California Institute of Biodiversity. The animation and design was done by me. The voice over was done by Ross Raymen.', 'video/mp4', NULL, '2018-11-13 05:15:27', '2018-11-13 05:15:27', NULL),
