('68', '43', '1', 'Gravity Song (Preschool Science)', 'f1dad9ecd6.mp4', 'Gravity is pulling me down\r\nGravity is pulling me down\r\nTheres a force we cannot see \r\nIts the force of gravity\r\nGravity pulls everything together \r\nGravitys the reason why\r\nYou cant jump into the sky \r\nGravity pulls you down \r\nAnd makes things fall\r\nMassive things like moons and stars \r\nEarth, Venus, Jupiter, and Mars \r\nHave a lot of gravitational pull\r\nLittle things like rocks and balls\r\nDont have much gravity at all \r\nThe only gravity we feel\r\nIs from the giant planet Earth\r\nGravity is pulling me down \r\nGravity is pulling me down\r\nThe sun although it looks so small \r\nIs the biggest thing of all\r\nIn our solar system\r\nThe sun has so much gravity\r\nIt keeps our planets orbiting \r\nSo they dont float away Into space\r\nGravity is pulling me down \r\nGravity is pulling me down \r\nGravity is pulling me down \r\nGravity is pulling me down', 'video/mp4', NULL, '2018-11-13 06:39:22', '2018-11-13 06:39:22', NULL),
('69', '43', '2', 'Gravity Song (physics)', 'e1735b33e2.mp4', 'Gravity is all around,\r\nWhen I fall it pulls me to the ground!\r\nA force that you and I cant see,\r\nPulls me toward you, and you towards me!\r\nKeeps us from flying into space,\r\nWhy I fall when I trip on my shoelace,\r\nThat cool force is gravity,\r\nThank Isaac Newtons apple tree!\r\n\r\nGravity,\r\nA force thats pulling you and me,\r\nGravity,\r\nPulls Jupiter, Mars, and Mercury,\r\nGravity,\r\nA force thats pulling you and me,\r\nDown and down,\r\nAs our Earth spins round and round\r\n\r\nI fall,\r\nYou fall,\r\nWe all fall down!\r\nThe force of gravity \r\nPulling us to the ground,\r\nYou can never see it,\r\nIt never makes a sound,\r\nIt makes our mother Earth,\r\nGo round, and round and round,\r\nThe planets have their orbits,\r\nBecause of gravity,\r\nPulls on flying objects,\r\nPulls on you and me!\r\nMakes an apple fall, \r\nLets us slip down slides,\r\nMakes a yo-yo go,\r\nAnd oceans have their tides!\r\nGravity, we all fall down!\r\nGravity, we all fall down!\r\nGravity, we all fall down!\r\nGravity, we all fall down!\r\n\r\nHey gravity, hey gravity hey,\r\nDont make me fall down today!\r\nHeres the reason, why Im scared,\r\n32 feet per second squared!\r\nHey gravity, hey gravity hey,\r\nDont make me fall down today!\r\nHeres the reason, why Im scared,\r\n32 feet per second squared!\r\n\r\nGravity,\r\nA force thats pulling you and me,\r\nGravity,\r\nPulls Jupiter, Mars, and Mercury,\r\nGravity,\r\nA force thats pulling you and me,\r\nDown and down,\r\nAs our Earth spins round and round\r\n\r\nPulls Jupiter, Mars, and mercury,\r\nAnd all the planets I can see, \r\nPulled in orbits around the sun,\r\nThe sun is pulling everyone?\r\nSun has so much gravity,   \r\nA whole bunch more than you and me!\r\nGreat big mass, big gravity,\r\nId weigh much more on the sun you see\r\n \r\nId weigh much more,\r\nOn the sun you see,\r\nGreat big ball of mass,\r\nMeans more gravity, \r\nThe great amount of mass,\r\nMeans the greater the pull,\r\nA dog has less mass,\r\nThan a cow or a bull!\r\nIts not too strong,\r\nBut its all around,  \r\nIf it was real strong,\r\nWe couldnt jump up off the ground,\r\nGravitys good,\r\nBased on mass not girth,\r\nGravitys good,\r\nIt holds us to the Earth!\r\n\r\nGravity, we all fall down!\r\nGravity, we all fall down!\r\nGravity, we all fall down!\r\nGravity, we all fall down!', 'video/mp4', NULL, '2018-11-13 06:41:22', '2018-11-13 06:41:22', NULL),
