('71', '43', '4', 'Gravity Compilation Crash Course Kids', '4a44ba4f2c.mp4', 'Maybe you\'d like to just hear about one topic for a while. We understand. So today, let\'s just watch some videos about Gravity. We\'ll learn about why we don\'t fly off into space, what mass has to do with it, how does air resistance work, and why gravity is different on the moon. In this compilation, Sabrina helps us understand some of these things.  ', 'video/mp4', NULL, '2018-11-13 06:46:06', '2018-11-13 06:46:06', NULL),
