('80', '33', '1', '7 Continents Song', '3c60cbfc5c.mp4', 'Seven Continents Lyrics:\r\n\r\nNorth America, South America\r\nAfrica, Europe, Asia\r\nAustralia, Antarctica\r\nThe seven continents of our world\r\nNorth America, South America\r\nAfrica, Europe, Asia\r\nAustralia, Antarctica\r\nThe seven continents of our world\r\nEarth has two hemispheres\r\nThe northern and the southern\r\nThe northern is the top half\r\nThe southern   is below\r\nEarth has two poles\r\nA north pole and a south pole\r\nThe North Poles at the top\r\nThe South Poles south we know\r\nNorth America, South America\r\nAfrica, Europe, Asia\r\nAustralia, Antarctica\r\nThe seven continents of our world\r\nThe equator is a line \r\nLike a belt around the middle \r\nIts the hottest place on earth\r\nBecause it lines up with the sun\r\nThe sun is a light source \r\nAnd a heat source like an oven\r\nGet closer to the heat\r\nThe hotter you become\r\nNorth America, South America\r\nAfrica, Europe, Asia\r\nAustralia, Antarctica\r\nThe seven continents of our world\r\nThe seven continents of our world\r\nThese are the seven continents of \r\nour world', 'video/mp4', NULL, '2018-11-16 14:56:19', '2018-11-16 14:56:19', NULL),
('81', '33', '2', 'Seven Continents Song (Hopscotch)', 'e4ebb07a6a.mp4', 'Lyrics:\r\nThe world is split up into continents, there are seven in all\r\nAnd if you get the gist, were gonna make a list from biggest to small:\r\n\r\nThey are:\r\nAsia, Africa, North and South America\r\nAntarctica, Europe, and finally Australia\r\nAsia, Africa, North and South America\r\nAntarctica, Europe, and finally Australia\r\n\r\nHey! My name is Asia, \r\nAnd more than half of the world lives here, but, whatever\r\n\r\nAnd I am Africa, with desert for miles \r\nAnd my Nile is the longest river\r\n\r\nNorth America! Start down in Panama, \r\nWide open spaces, all the way to Canada\r\n\r\nI\'m South America with animals galore, \r\nWhere the rainforest grows cause the rain really pours\r\n\r\nIm Antarctica, and Im totally ice\r\n\r\nAnd Im Europe.  Youre welcome...\r\nFor the pasta, pizza, waffles, and fries\r\n\r\nI am Australia, some call me Oceania, \r\nI got a lot of islands, too many to explain to ya\r\n\r\nWe are\r\nAsia, Africa, North and South America\r\nAntarctica, Europe, and finally Australia', 'video/mp4', NULL, '2018-11-16 14:59:35', '2018-11-16 14:59:35', NULL),
('82', '33', '4', 'Continents and Oceans by (ABCmouse.com)', 'c44f06dc94.mp4', 'Song Lyrics:\r\n\r\nOur Earth is a very, very, very big place! \r\nIt is covered by water and land. \r\nIt has five huge oceans, where we can swim, \r\nAnd seven continents, where we can stand. \r\n\r\nAsia is the continent that has the most people. \r\nIts also the largest in size. \r\nIt has the 50 highest mountains in the world \r\nTheir peaks reach high into the skies. \r\nSecond largest is Africa. \r\nIts the hottest continent of all. \r\nIt has the largest sandy desert in the world \r\nAnd animals both large and small. \r\nIf Africas hottest, then which is the coldest? \r\nAntarcticabut its so very cold. \r\nIts only home to seals, penguins, \r\nand other birds. \r\nThough theres snow, its the driest, Im told! \r\nAnd which is the wettest? Its South America! \r\nRainforests cover much of its face. \r\nMillions of animal species live there. \r\nYoull find them all over the place! \r\nOur Earth is a very, very, very big place! \r\nIt is covered by water and land. \r\nIt has five huge oceans, where we can swim, \r\nAnd seven continents, where we can stand. \r\nLets look at Australia. \r\nIts the smallest of continents. \r\nThe fewest people call it home. \r\nMost of its land is the bushland and outback, \r\nWhere koalas and kangaroos roam. \r\n\r\nNow on to Europe. Though its rather small, \r\nIt has dozens of famous old cities. \r\nBerlin, Madrid, Paris, London, and Rome \r\nEach city is uniquely pretty! \r\nLast but not least is North America. \r\nIts the continent that I know best. \r\nIt is the home of our own United States \r\nA wonder from East Coast to West! \r\nBut lets not forget, there are also five oceans. \r\nPlease let me be quite specific. \r\nTheir names are the Southern, Atlantic, \r\nand Arctic, \r\nThe Indian, and the Pacific! \r\n\r\nOur Earth is a very, very, very big place! \r\nIt is covered by water and land. \r\nIt has five huge oceans, where we can swim, \r\nAnd seven continents, where we can stand. \r\n\r\nI hope you learned something \r\nabout all the continents \r\nAnd the names of our five oceans. \r\nHopefully, someday you will travel to each, \r\nBut only if you get the notion! \r\n\r\nOur Earth is a very, very, very big place! \r\nIt is covered by water and land. \r\nIt has five huge oceans, where we can swim, \r\nAnd seven continents, where we can stand.\r\n', 'video/mp4', NULL, '2018-11-16 15:02:13', '2018-11-16 15:14:31', NULL),
('83', '33', '3', 'The Seven Continents Song', '6417e880bd.mp4', 'LYRICS:\r\n\r\nNorth America, South America\r\nAfrica, Europe and Asia\r\nAustralia, Antarctica\r\nSeven continents\r\nBack to the startica\r\n\r\nNorth America, South America\r\nAfrica, Europe and Asia\r\nAustralia, Antarctica\r\nNow it\'s time for the verse to startica\r\n\r\nNow the first thing we wanna bring to this class\r\nIs that a continent is a large land mass\r\nSurrounded by great big bodies of water\r\nCalled oceans (they\'re bigger) and seas (they\'re smaller)\r\n\r\nSo why don\'t we start with North America \r\nMade of Mexico, United States and Canada\r\nThen we can move south past the equator\r\nTo South America where the heat is greater\r\nSpeaking of heat the next continent\'s blazing\r\nIt\'s Africa where the animals are amazing\r\nNext is Europe and then there\'s Asia\r\nTogether they\'re the largest land mass \'cause they\'re neighbors\r\nAnd then we go to Australia down under\r\nWhere the Sydney Opera House is a known world wonder\r\nLast is Antarctica down at the bottom\r\nThe whole thing is frozen like Elsa and Anna\r\n\r\nNorth America, South America\r\nAfrica, Europe and Asia\r\nAustralia, Antarctica\r\nSeven continents\r\nBack to the startica\r\n\r\nNorth America, South America\r\nAfrica, Europe and Asia\r\nAustralia, Antarctica\r\nNow it\'s time for us to departica', 'video/mp4', NULL, '2018-11-16 15:05:03', '2018-11-16 15:05:03', NULL),
('84', '33', '5', 'Seven Continents of the world ', '8e3e6c7aee.mp4', 'Continents are massive landmasses found on Earth. The Earth has seven such continents. From largest in size to the smallest; they are: \r\n\r\nAsia\r\nAfrica\r\nNorth America\r\nSouth America\r\nAntarctica\r\nEurope\r\nAustralia', 'video/mp4', NULL, '2018-11-16 15:37:12', '2018-11-16 15:37:12', NULL),
('85', '33', '6', 'How to Remember the Seven Continents! ...for Kids!', '909e9942cf.mp4', 'Having trouble remembering the seven continents? Well that\'s what this video is for! Join Mr. DeMaio on this fun social studies lesson for kids that will help you remember all 7 continents in no time.\r\n', 'video/mp4', NULL, '2018-11-16 15:38:34', '2018-11-16 15:38:34', NULL),
('86', '34', '1', 'Shapes Songs (The Kiboomers)', '50520107a8.mp4', 'SHAPES SONG LYRICS\' | \'LEARN SHAPES\' |\' SHAPES SONGS\'\r\n\r\nThere are many kinds of shapes\r\nI see them everywhere\r\nI love circles and rectangles\r\nTriangles and squares\r\n\r\nCircles!\r\n\r\nWhen I go walking I see circles\r\nEverywhere I go\r\nA circle is round like a steering wheel\r\nIts shaped just like an O\r\n\r\nLike the big bright sun\r\nAnd a cinnamon bun\r\nAnd the wheels on a bicycle\r\nRound and round they go\r\n\r\nLike a big balloon\r\nLike the big full moon\r\nHow many kinds of circles  \r\nDo you know?\r\n\r\nSquares!\r\n\r\nI see squares when we go to town\r\nTheyre everywhere you turn\r\nThey have four sides of the very same length\r\nLets see what we can learn\r\n\r\nLike a pizza box\r\nAnd my toy blocks\r\nEqual sides of 1,2,3,and 4\r\nLike a picture frame\r\nOr a windowpane\r\nA square is just a shape that I adore\r\n\r\nTriangles!\r\n\r\nHere and there I find triangles\r\nLook around and see\r\nAnd a triangle has three sides\r\nOne and two and three\r\n\r\n\r\nLike a pizza slice\r\nA piece of pie is nice\r\nHow about a great big\r\nIce cream cone?\r\n\r\nLike a volcano\r\nOr the sail on my boat\r\nOr a steeple, or the shape of the roof\r\nThats on my home\r\n\r\nRectangles!\r\n\r\nI share my house\r\nWith a lot of rectangles\r\nLets just take a look\r\nWith two sides long\r\nAnd two sides short\r\nTheyre shaped just like a book\r\n\r\nLike my front door\r\nAnd the rug on my floor\r\nLike a fridge, like a brick\r\nLike a bed, like a stereo\r\n\r\nLike a Kleenex box\r\nAnd my grandfather clock\r\nI see rectangles\r\nEverywhere I go!\r\n\r\nThere are many kinds of shapes\r\nI see them everywhere\r\nI love circles and rectangles\r\nTriangles and squares. ', 'video/mp4', NULL, '2018-11-23 13:33:57', '2018-11-23 13:33:57', NULL),
('87', '34', '2', 'he Shape Song #1 (Super Simple Songs)', '1fc5cc35de.mp4', 'Lyrics\r\nA circle. A circle. Can you make a circle?\r\nA circle. A circle. Can you make a circle?\r\nA circle. A circle. Can you find a circle? \r\nA circle. A circle. Can you find a circle?\r\nCan you find a circle? Ready...GO! \r\n\r\nI know...let\'s make a diamond. Can you make a diamond? Here we go...\r\nA diamond. A diamond. Can you make a diamond? \r\nA diamond. A diamond. Can you make a diamond?\r\nA diamond. A diamond. Can you find a diamond? \r\nA diamond. A diamond. Can you find a diamond?\r\nCan you find a diamond? Ready...GO! \r\n\r\nHmm...what\'s next? How about a square?\r\nA square. A square. Can you make a square? \r\nA square. A square. Can you make a square?\r\nA square. A square. Can you find a square? \r\nA square. A square. Can you find a square?\r\nCan you find a square? Ready...GO! \r\n\r\nAlright. Time for one more. Let\'s try a heart.\r\nA heart. A heart. Can you make a heart? \r\nA heart. A heart. Can you make a heart?\r\nA heart. A heart. Can you find a heart? \r\nA heart. A heart. Can you find a heart?\r\nCan you find a heart? Ready...GO!\r\n\r\nA circle, a diamond, a square, and a heart.\r\nA circle, a diamond, a square, and a heart.\r\nA circle, a diamond, a square, and a heart.', 'video/mp4', NULL, '2018-11-23 13:36:14', '2018-11-23 13:36:14', NULL),
('88', '34', '3', 'The Shape Song #2  (Super Simple Songs)', '3213c29d95.mp4', 'Lyrics\r\nOkay everybody. We\'re going to make some shapes. Show me your hands.\r\nLet\'s start with a triangle!\r\nA triangle. Can you make a triangle? \r\nA triangle. Can you make a triangle?\r\nA triangle. Can you find a triangle? \r\nA triangle. Can you find a triangle?\r\nCan you find a triangle? Ready...GO! \r\n\r\nNow, let\'s make a rectangle!\r\nA rectangle. Can you make a rectangle?\r\nA rectangle. Can you make a rectangle?\r\nA rectangle. Can you find a rectangle? \r\nA rectangle. Can you find a rectangle?\r\nCan you find a rectangle? Ready...GO! \r\n\r\nHow about an oval?\r\nAn oval. Can you make an oval?\r\nAn oval. Can you make an oval?\r\nAn oval. Can you find an oval? An oval. Can you find an oval?\r\nCan you find an oval? Ready...GO!\r\n\r\nNow, let\'s make a star!\r\nA star. Can you make a star?\r\nA star. Can you make a star?\r\nA star. Can you find a star?\r\nA star. Can you find a star?\r\nCan you find a star? Ready...GO!\r\n\r\nA triangle, a rectangle, an oval, and a star.\r\nA triangle, a rectangle, an oval, and a star.\r\nA triangle, a rectangle, an oval, and a star.....\r\n', 'video/mp4', NULL, '2018-11-23 13:38:00', '2018-11-23 13:38:00', NULL),
