('90', '34', '5', 'Sing along Shapes Song', '6443582151.mp4', 'Shapes are Everywhere! Learn shapes while you sing along to this kids song (with lyrics). Can you spot the different shapes in everyday objects? A computer screen has a rectangle shape, a clock has a circle shape, a tent looks like a triangle, and a checker board has lots of squares! Can you find them all?? Teach your children all about shapes, with the help of our shape song and our friend Debbie Doo! ', 'video/mp4', NULL, '2018-11-23 13:40:38', '2018-11-23 13:40:38', NULL),
('91', '34', '6', 'Shape Song  Shapes (Song  preschool)', 'a61ab265e9.mp4', 'Triangle, Rectangle, Circle, Oval, Square\r\nTriangle, Rectangle, Circle, Oval, Square\r\n\r\nI am a circle round and round,\r\nround and round,\r\nround and round,\r\nI am a circle round and round,\r\nround and round,\r\nround and round,\r\nI am a circle round and round,\r\nround and round,\r\nround and round I am.\r\n\r\nTriangle, Rectangle, Circle, Oval, Square\r\nTriangle, Rectangle, Circle, Oval, Square\r\n\r\nI am a four sided square,\r\nshaped like a box,\r\nI am a four sided square,\r\nshaped like a box,\r\nshaped like a box,\r\nI am a four sided square,\r\nand all four sides are the same.\r\n\r\nTriangle, Rectangle, Circle, Oval, Square\r\nTriangle, Rectangle, Circle, Oval, Square\r\n\r\nI am a triangle with three sides,\r\nthree straight sides,\r\nI am a triangle with three sides,\r\nthree straight sides,\r\nthree straight sides,\r\nI am a triangle with three sides,\r\nand a pointy head.\r\n.\r\nTriangle, Rectangle, Circle, Oval, Square.\r\nTriangle, Rectangle, Circle, Oval, Square.\r\n\r\nI am a star with five points,\r\nfive little points,\r\nI am a star with five points,\r\nfive little points,\r\nfive little points,\r\nI am a star with five points,\r\nblinking in the sky.\r\n\r\nTriangle, Rectangle, Circle, Oval, Square.\r\nTriangle, Rectangle, Circle, Oval, Square.\r\n\r\nI am a rectangle you see,\r\nlike a very long square,\r\nI am a rectangle you see,\r\nlike a very long square,\r\nlike a very long square,\r\nI am a rectangle you see,\r\nI am straight and long like a brick.\r\n\r\nTriangle, Rectangle, Circle, Oval, Square.\r\nTriangle, Rectangle, Circle, Oval, Square.\r\n\r\nI am an oval round and long,\r\nround and long,\r\nI am an oval round and long,\r\nround and long,\r\nround and long,\r\nI am an oval round and long,\r\nlike a circle very long indeed.\r\n\r\nTriangle, Rectangle, Circle, Oval, Square.\r\nTriangle, Rectangle, Circle, Oval, Square.', 'video/mp4', NULL, '20