('104', '53', '1', 'Time: \"Four Seasons,\" The Seasons of the Year by StoryBots', 'b372c433db.mp4', 'Cold weather\'s kind of winter\'s thing\r\nIn spring, the plants get back their bling\r\nBy summer they\'re in full-swing\r\nBut in fall, their leaves go tumbling\r\nDown, down, down to the bottom\r\nOh, that reminds me\r\nSome folks call fall \'autumn\', well anyway\r\n\r\nWinter, spring\r\nSummer, fall\r\nOne year, four seasons in all\r\n\r\nWinter, spring\r\nFour seasons you can count them all\r\n\r\nWinter, spring\r\nSummer, fall\r\nOne year, four seasons in all\r\n\r\nWinter, spring\r\nSummer, fall\r\nAnd now you know them once and for all', 'video/mp4', NULL, '2018-12-30 15:23:47', '2018-12-30 15:23:47', NULL),
