('109', '54', '2', 'Time: \"Seconds, Minutes and Hours\" by StoryBots', 'eefdf8eba9.mp4', 'SECONDS, MINUTES AND HOURS\r\n\r\nA second is the length of this gong [gong]\r\nA minute is the length of this song\r\nAnd if you listened to it sixty times,\r\nYou\'ll have listened an hour long\r\n\r\nA second is the length of this pop [pop]\r\nA minute is sixty of them non-stop\r\nSixty minutes is an hour, that\'s way more pops\r\nYou get the idea, we can go ahead and stop the pops \r\n\r\nA day has twenty-four hours\r\nAnd I\'m sure that you would agree \r\nThat\'s a lot easier to remember\r\nThan however many seconds that that would be\r\n\r\nSixty seconds a minute\r\nSixty minutes an hour\r\nTwenty-four hours a day\r\nIs that too tough for us learn?\r\nNo way!\r\n\r\nSixty seconds a minute\r\nSixty minutes an hour\r\nTwenty-four hours a day\r\nIs that too tough for us learn?\r\nNo way Jose!', 'video/mp4', NULL, '2018-12-31 00:54:57', '2018-12-31 00:54:57', NULL),
('110', '39', '1', 'The Five Senses Song  Silly School Songs', '8fcb8554e7.mp4', 'LYRICS:\r\n\r\nI see it \r\nI hear it \r\nI smell it \r\nI taste it\r\nI touch it\r\nFive senses\r\n\r\nI see it \r\nI hear it \r\nI smell it \r\nI taste it\r\nI touch it\r\nFive senses\r\n\r\nSeeing, hearing, smelling tasting touching\r\nFive senses\r\nSeeing, hearing, smelling tasting touching\r\nFive senses\r\n\r\nSeeing--it\'s what I do with my eyes\r\nClose them, open them, yell \"Surprise!\"\r\n\r\nHearing--it\'s what I do with my ears\r\nHigh sounds, low sounds, what do I hear?\r\n\r\nSmelling--it\'s what I do with my nose\r\nI smell pretty flowers or stinky toes\r\n\r\nTasting--it\'s what I do with my tongue\r\nEat it up, drink it up, yum yum yum!\r\n\r\nTouching--it\'s what I do with my hands\r\nSmooth like silk or rough like sand\r\n\r\nI see it \r\nI hear it \r\nI smell it \r\nI taste it\r\nI touch it\r\nFive senses\r\n\r\nI see it \r\nI hear it \r\nI smell it \r\nI taste it\r\nI touch it\r\nFive senses\r\n\r\nSeeing, hearing, smelling tasting touching\r\nFive senses\r\nSeeing, hearing, smelling tasting touching\r\nFive senses', 'video/mp4', NULL, '2019-03-04 05:49:53', '2019-03-04 05:49:53', NULL),
