('122', '21', '1', 'Rainbow Colors Song', 'f18be68b37.mp4', 'Lyrics:\r\n\r\nVerse 1:\r\n\r\nTell me, tell me, what do you see?\r\nI see an apple, and it\'s red!\r\n\r\nTell me, tell me, what do you see?\r\nI see a carrot, and it\'s orange!\r\n\r\nTell me, tell me, what do you see?\r\nI see a lemon, and it\'s yellow!\r\n\r\nTell me, tell me, what do you see?\r\nI see a frog, and it\'s green!\r\n\r\nRainbow colors everywhere\r\nRed, orange, yellow, green\r\nRainbow colors everywhere\r\nBlue, purple, pink!\r\n\r\nChorus:\r\nRed, orange, yellow, green, blue, purple, pink\r\n(kids repeat)\r\n\r\nVerse 2:\r\n\r\nTell me, tell me, what do you see?\r\nI see a fish, and it\'s blue!\r\n\r\nTell me, tell me, what do you see?\r\nI see a flower, and it\'s purple!\r\n\r\nTell me, tell me, what do you see?\r\nI see a flamingo, and it\'s pink!\r\n\r\nRainbow colors everywhere\r\nRed, orange, yellow, green\r\nRainbow colors everywhere\r\nBlue, purple, pink!\r\n\r\nChorus:\r\nRed, orange, yellow, green, blue, purple, pink', 'video/mp4', NULL, '2019-03-07 01:37:48', '2019-03-07 01:39:03', NULL),
('123', '61', '1', 'Get Dressed for the Day Song  The Singing Walrus', 'e21e42163d.mp4', 'The Singing Walrus creates fun teaching materials, such as kids songs, educational games, nursery rhymes, and kindergarten worksheets (e.g. handwriting worksheets) for parents and teachers. ', 'video/mp4', NULL, '2019-03-07 02:11:44', '2019-03-07 02:11:44', NULL),
('124', '58', '1', 'Biology Cell Structure I Nucleus Medical Media', '7bf9e7a813.mp4', 'This animation by Nucleus shows you the function of plant and animal cells for middle school and high school biology, including organelles like the nucleus, nucleolus, DNA (chromosomes), ribosomes, mitochondria, etc. Also included are ATP molecules, cytoskeleton, cytoplasm, microtubules, proteins, chloroplasts, chlorophyll, cell walls, cell membrane, cilia, flagellae, etc.', 'video/mp4', NULL, '2019-03-12 05:13:55', '2019-03-12 05:13:55', NULL),
