INSERT INTO `lessons` (`id`, `name`, `objective`, `description`, `file_name`, `created_at`, `updated_at`, `deleted_at`) VALUES ('15', 'Days of the week ', '(1)Correctly pronounce the 7 days of the week, (2) name the days of the week with a response time of 3 seconds or less. ', 'You will learn about the 7 days of the week, you will learn their names and remember their order. ', '1465a3a36f.png', '2018-10-18 18:45:51', '2018-10-18 20:46:17', NULL),
('16', 'Months of the year', '', 'Here we will learn about the twelve months of the year. They each have a unique name that you will know by the end of this lesson. I sure hope you enjoy learning about the twelve months of the year. ', 'ad76411003.jpg', '2018-10-20 00:30:26', '2018-10-28 06:09:50', NULL),
('17', 'The Solar System', '', 'The Solar System is the gravitationally bound system of the Sun and the objects that orbit it, either directly or indirectly, including the eight planets and five dwarf planets as defined by the International Astronomical Union.', 'e5d7f5f017.jpg', '2018-10-29 03:02:45', '2018-10-29 03:02:45', NULL),
('18', 'The Water Cycle', '', 'The water cycle, also known as the hydrological cycle or the hydrologic cycle, describes the continuous movement of water on, above and below the surface of the Earth.', '0a3b07b2ea.jpg', '2018-10-29 03:03:28', '2018-10-29 03:03:28', NULL),
('19', 'Materials', '', 'In industry, materials are inputs to production or manufacturing processes. They may either be raw material, that is, unprocessed, or processed before being used in more advanced production processes, either by distillation or synthesis (synthetic materials).', '0ad6e95ca4.jpg', '2018-10-29 03:04:39', '2018-10-29 03:04:39', NULL),
('20', 'Sports', '', 'an activity involving physical exertion and skill in which an individual or team competes against another or others for entertainment: team sports such as baseball and soccer | (as modifier sports) : a sports center.', '7afea9f4ac.png', '2018-10-29 03:06:55', '2018-10-29 03:06:55', NULL),
('21', 'Colors A', '', 'Color (American English) or colour (Commonwealth English) is the characteristic of human visual perception described through color categories, with names such as red, orange, yellow, green, blue, or purple.', '5dae3a65f9.jpg', '2018-10-29 03:08:52', '2018-10-29 03:21:08', NULL),
('22', 'My House A', '', 'Learn about the rooms in your house. Each of them has a name.', 'b730c7c0f8.jpg', '2018-10-29 03:26:22', '2019-05-10 02:12:25', NULL),
('23', 'Animals ', '', 'Animals that we keep at home are called pets. Pets can keep you company and make your life more interesting. ', 'c259906d55.png', '2018-10-29 03:29:54', '2019-05-10 04:24:42', NULL),
('24', 'Animals in action ', '', 'This brain break music and movement song has jungle music, lots of animals and opportunities for children to move like the animals move.  This song also teaches children listening skills because its a repeat after me song, too.  As a great brain break song or in physical education this song really gets children singing and getting those wiggles out as they move like animals.   This video features animals in their natural habitat.  We use real animals in their natural environment.  After this fun brain break, your children will be ready to re-focus and get back to optimal learning.\r\n', '75b0443998.jpg', '2018-10-29 03:31:26', '2019-08-23 02:18:07', NULL),
('25', 'Farm Animals', '', 'Livestock are domesticated animals raised in an agricultural setting to produce labor and commodities such as meat, eggs, milk, fur, leather, and wool. The term is sometimes used to refer solely to those that are bred for consumption, while other times it refers only to farmed ruminants, such as cattle and goats', 'd4ebc0cada.jpg', '2018-10-29 03:33:07', '2018-10-29 03:33:07', NULL),
('27', 'Telling Time', '', 'What time is it? Help your child tell time with our offering of worksheets, games, and activities. Learning telling time is often a tedious task, but our materials make reading clocks and determining elapsed time a breeze for your child. Take a look! Check out Education.com\'s other resources to get some more math help.', '41de898c01.png', '2018-10-29 03:36:13', '2018-10-29 03:36:13', NULL),
('28', 'Weather', '', 'Here we will learn about the weather. ', 'b823f36db9.jpg', '2018-10-29 04:13:14', '2018-10-29 04:13:14', NULL),
('29', 'Summer Clothing', '', 'Here we will learn the names of clothing that you wear in the summer.', '1bbdf7eaa8.jpg', '2018-10-29 04:22:16', '2018-10-29 04:22:16', NULL),
('30', 'Winter Clothing', '', 'Winter clothing are clothes used for protection against the particularly cold weather of winter. Often they have a good water resistance, consist of multiple layers to protect and insulate against low temperatures.', '45fc0622b7.jpg', '2018-10-29 04:23:50', '2018-10-29 04:23:50', NULL),
('31', 'Fruits A', '', 'Apples and pears. Citrus  oranges, grapefruits, mandarins and limes. Stone fruit  nectarines, apricots, peaches and plums. Tropical and exotic  bananas and mangoes. Berries  strawberries, raspberries, blueberries, kiwifruit and passionfruit.', 'c9b3528208.jpg', '2018-10-29 04:26:47', '2018-10-29 04:26:47', NULL),
('33', 'The Seven Continents', '', 'Generally identified by convention rather than any strict criteria, up to seven regions are commonly regarded as continents. Ordered from largest in area to smallest, they are: Asia, Africa, North America, South America, Antarctica, Europe, and Australia.', '79867a2d10.jpg', '2018-10-29 04:31:35', '2018-10-29 04:31:35', NULL),
('34', 'Shapes A', '', 'A shape is the form of an object or its external boundary, outline, or external surface, as opposed to other properties such as color, texture or material composition.', '12d2f15366.png', '2018-10-29 04:32:48', '2018-10-29 04:32:48', NULL),
('35', 'School Subjects A', '', 'Here you will learn about the names of the school subjects', 'dcd87a23ae.jpg', '2018-10-29 05:13:30', '2018-10-29 05:13:30', NULL),
('36', 'Professions A', '', 'Here we will learn about a few popular professions. A profession what someone does to earn a living. ', 'a56152687a.jpg', '2018-10-29 05:19:00', '2018-10-29 05:19:00', NULL),
('37', 'Transportation', '', 'Transport or transportation is the movement of humans, animals and goods from one location to another. In other words the action of transportation is defined as a particular movement of an organism or thing from a point A to the Point B. Modes of transport include air, land, water, cable, pipeline and space.', '47b1dcc763.png', '2018-10-29 05:24:26', '2018-10-29 05:24:26', NULL),
('38', 'Places in Our Town', '', 'There are many facilities in a town and in this lesson we will learn their names. ', '1da1c7f393.jpg', '2018-10-29 05:29:04', '2018-10-29 05:29:04', NULL),
('39', 'Five Senses', '', 'Five senses refers to the five traditionally recognized methods of perception, or sense: taste, sight, touch, smell, and sound.', '60b05da2c1.jpg_c200', '2018-10-29 07:43:11', '2018-10-29 07:43:11', NULL),
('40', 'Yesterday, Today, Tomorrow', '', '', '6775a624b4.jpg', '2018-11-03 06:10:24', '2018-11-03 06:10:24', NULL),
('41', 'The Earth\'s Atmosphere', '', 'An atmosphere is a layer or a set of layers of gases surrounding a planet or other material body, that is held in place by the gravity of that body. An atmosphere is more likely to be retained if the gravity it is subject to is high and the temperature of the atmosphere is low.', '0401242e3d.png', '2018-11-06 06:57:04', '2018-11-06 06:57:04', NULL),
('42', 'Count from 1 to 20', '', 'Learners will learn to count from 1 to 20 by first listening to engaging songs that repeat these numbers over and over again. ', '015b43af1e.jpg', '2018-11-09 08:06:54', '2018-11-09 08:06:54', NULL),
('43', 'Gravity', '', 'Gravity is the force by which a planet or other body draws objects toward its center. The force of gravity keeps all of the planets in orbit around the sun.', '15461d5fa6.jpg', '2018-11-13 05:41:21', '2018-11-13 05:41:21', NULL),
('44', 'The Alphabet', '', 'Here kids will learn the 26 letters of the alphabet', 'a05cf6c737.jpg', '2018-11-16 13:11:37', '2018-11-16 13:11:37', NULL),
('45', 'The Brain', '', 'The human brain is the command center for the human nervous system. It receives signals from the body\'s sensory organs and outputs information to the muscles. The human brain has the same basic structure as other mammal brains but is larger in relation to body size than any other brains.', '6fb011a372.jpg', '2018-11-27 05:59:18', '2018-11-27 05:59:18', NULL),
('46', 'Communication', '', 'Learn about information, wisdom and knowledge, through the subject of communication. ', 'deccc176d0.png', '2018-12-04 07:02:27', '2018-12-04 07:02:27', NULL),
('47', 'Magnetism', '', 'Magnetism is a class of physical phenomena that are mediated by magnetic fields. Electric currents and the magnetic moments of elementary particles give rise to a magnetic field, which acts on other currents and magnetic moments.', 'ceccac748a.png', '2018-12-11 06:55:16', '2018-12-11 06:55:16', NULL),
('48', 'Countries-Asia', '', 'Learn the names of asian countries. ', '2b59de788e.png', '2018-12-14 13:07:07', '2018-12-14 13:07:07', NULL),
('49', 'The 5 Big Oceans ', 'Learn the names of the 5 big oceans.', 'In this lesson you will learn the names and some general facts about the 5 big oceans of the world. ', 'd092b37a69.jpeg', '2018-12-15 11:34:30', '2018-12-15 11:36:37', NULL),
('50', 'I have a dream speech', 'Learn the I have a dream speech of Martin Luther King', '', '312cfe4624.jpeg', '2018-12-15 12:20:24', '2018-12-15 12:20:24', NULL),
('51', 'Computers', 'Learn what parts a computer is made off', '', '42881a8c14.jpeg', '2018-12-25 06:45:29', '2018-12-25 06:45:29', NULL),
('52', 'Describe: Facial Characteristics', '', 'In this lesson you will learn the basics of describing and naming the parts of a human face.', 'b4424c7cb8.jpg', '2018-12-30 02:00:10', '2018-12-30 02:09:56', NULL),
('53', 'The four Seasons', '', 'Learn the names of the four seasons. ', '4154dadc0e.png', '2018-12-30 15:04:57', '2018-12-30 15:04:57', NULL),
('54', 'Time: Seconds, Minutes, Hours', '', 'Learn the designations of seconds, minutes, hours and their relationship. ', '461a6697aa.png', '2018-12-31 00:37:32', '2018-12-31 00:37:32', NULL),
('55', 'Insects', 'Learn the characteristics of the different insects. ', 'In this lesson learners will learn about the different characteristics that define an insect. ', 'ba685b26ab.jpeg', '2019-01-12 00:55:43', '2019-01-12 00:55:43', NULL),
('56', 'Birds', 'Learn facts of the class of birds.', 'Here we will learn about birds and their characteristics. ', 'dab9d875d2.jpg', '2019-01-25 00:58:03', '2019-01-25 00:58:03', NULL),
('57', 'Clothing A', '', '6', 'ad9ba95706.jpg', '2019-03-05 03:33:25', '2019-03-07 01:47:18', NULL),
('58', 'Cells', 'Learn about the building blocks of life.', 'In this lesson we will lear about cells.', '77c1e7c2b0.jpeg', '2019-03-05 06:43:41', '2019-03-05 06:43:41', NULL),
('59', 'vegetables A', 'Learn the names of the most common vegetables. ', 'Students will learn the names of vegetables. ', '345bdef7ca.jpg', '2019-03-06 13:24:24', '2019-03-06 14:05:41', NULL),
('60', 'vegetable B', 'Learn about more vegetables in lesson B', 'You will learn more vegetable names.', '56c0a65969.jpg', '2019-03-06 14:05:27', '2019-03-06 14:05:27', NULL),
('61', 'Clothing B', '- Naming different pieces of clothing\r\n- using the phrases \"Put on your ...\" and \"Get dressed\"\r\n- making decisions on what to wear for which weather (sun, wind, rain, snow)\r\n', 'Since getting dressed is an important part of every child\'s morning routine, we have always wanted to write a song about it. And now here it is! Our Get Dressed for the Day Song! We hope the song will be helpful for teachers, parents, and caregivers - and, most importantly, a lot of fun for the kids :) \r\n', '39e8712d9e.jpeg', '2019-03-07 01:52:27', '2019-03-07 01:52:27', NULL),
('62', 'body parts A', 'From head to chin to fingers to toes, your students will love this fast-paced song and video.  Be sure to check out the slow version of this song here', '', '6e0d8bd6f5.jpeg', '2019-03-07 02:52:07', '2019-03-07 02:52:38', NULL),
('63', 'Biology: Germs', 'Learn about the microscopic live forms that cause disease and help us to keep a healthy colon.   ', 'We will learn about the germs around us. ', 'c5de964e3d.png', '2019-04-16 06:36:31', '2019-04-16 06:36:31', NULL),
('64', 'My House B', '', 'This \"Kids Vocabulary\" category has been grouped thematically. \r\nWe hope you enjoy studying with our channel videos.\r\nHave fun and subscribe to our channel. Then, you can find some more various English educational animation videos.', '50157b575e.jpg', '2019-05-09 14:16:24', '2019-05-10 02:25:23', NULL),
('65', 'prepositions A', 'The Prepositions Song teaches you where things are in English! This video is great for when you are learning location prepositions or teaching prepositions of place.', '', '9378243566.png', '2019-05-26 04:00:26', '2019-05-26 04:00:50', NULL),
('66', 'prepositions B', 'A song to help children learn prepositions of place.', '', '874ab03803.png', '2019-05-26 04:33:43', '2019-05-26 04:33:43', NULL),
('67', 'flavours', 'flavours', 'flavours', '56b0326142.jpeg', '2019-06-16 12:01:15', '2019-06-16 12:01:15', NULL),
('68', 'Transportation', 'The \"Transportation Song - Cars, Planes, and Trains\" is a fun and groovy song for children. It introduces different means of transportation and their speed in relation to each other. \r\nEvery verse of the song features a vehicle, each showing a faster one than the last. ', 'Those who are familiar with our cute characters will enjoy watching them move from place to place, riding a bike, a bus, a car, a train, a plane, and finally a rocket!', '281979bb38.jpg', '2019-06-16 12:52:48', '2019-06-16 12:52:48', NULL),
('69', 'Musical Instruments', 'Come join the animal band and learn all about different types of musical instruments and the sounds that they make!  March along in the parade!', '', '9359eba056.png', '2019-07-16 12:36:00', '2019-07-16 12:36:00', NULL),
('70', 'What did you do yesterday?', '\r\n\r\nClick on the video in this compilation video.\r\nThe each video, that has sound & mute version, is accompanied by English subtitles.', '', '3bebd9ca33.png', '2019-09-10 00:04:50', '2019-09-10 00:04:50', NULL),
('71', 'Travel Song', 'Here is a song that\'s all about traveling! \r\nThe video shows our little chicks on their exciting journey around the world, riding a car, a train, and a plane. As they move through various landscapes, they all notice different things, depending on how they are traveling. ', '', '3277587f9e.jpeg', '2019-09-10 11:38:06', '2019-09-10 11:38:06', NULL);
