INSERT INTO `products` (`id`, `name`, `description`, `file_name`, `created_at`, `updated_at`, `deleted_at`) VALUES ('9', 'Fruit Fun Fruity', 'Delicious cookie with fruit flavor.', '8b4ecf77b4.jpeg', '2018-10-18 06:09:03', '2018-10-18 06:11:29', NULL),
('10', 'Alpenliebe ()', '', '6293d39d8c.jpeg', '2018-10-18 06:21:03', '2018-10-18 06:21:03', NULL),
('11', 'Doritos', 'Doritos is an American brand of flavored tortilla chips produced since 1964 by Frito-Lay, a wholly owned subsidiary of PepsiCo. The original Doritos were not flavoured. The first flavour was Taco, released in 1967, though other flavors have since debuted for the company. ', '0231a942e3.jpg', '2018-10-29 02:49:40', '2018-10-29 02:49:40', NULL),
('12', 'One Egg Popsicle', 'It\'s go good. ', '242822ce65.png', '2018-10-29 02:58:01', '2018-11-01 00:11:35', NULL),
('13', 'Arduino Uno', 'The Arduino UNO is an open-source microcontroller board based on the Microchip ATmega328P microcontroller and developed by Arduino.cc. The board is equipped with sets of digital and analog input/output pins that may be interfaced to various expansion boards and other circuits.', 'c8ad128dd8.jpg', '2018-11-01 00:09:02', '2018-11-01 00:09:49', NULL),
('14', 'Breadboard', 'A breadboard is a construction base for prototyping of electronics. Originally it was literally a bread board, a polished piece of wood used for slicing bread. In the 1970s the solderless breadboard (a.k.a. plugboard, a terminal array board) became available and nowadays the term \"breadboard\" is commonly used to refer to these.', '4011c0acfe.png', '2018-11-01 00:20:02', '2018-11-01 00:30:27', NULL),
('15', '5V DC Motor', 'A DC motor is any of a class of rotary electrical machines that converts direct current electrical energy into mechanical energy. The most common types rely on the forces produced by magnetic fields. Nearly all types of DC motors have some internal mechanism, either electromechanical or electronic, to periodically change the direction of current flow in part of the motor.', 'ebb796db06.png', '2018-11-01 00:21:51', '2018-11-01 00:32:28', NULL),
('16', 'LED (Light-emitting diode)', 'A light-emitting diode is a two-lead semiconductor light source. It is a pn junction diode that emits light when activated. When a suitable current is applied to the leads, electrons are able to recombine with electron holes within the device, releasing energy in the form of photons.', 'd9913d0ce1.jpg', '2018-11-01 00:35:56', '2018-11-01 00:35:56', NULL),
('17', 'LED-RGB (Light-emitting diode)', 'This LED has three leads and can produce red, green and blue light. ', '59590144da.jpg', '2018-11-01 00:37:23', '2018-11-01 00:37:23', NULL),
('18', 'Breadboard Jumper Wire', 'The male to male flexible breadboard jumper wire provides an easy way for you to build your own circuitry on a breadboard, ideal for creating circuits between your microcontroller and the breadboard on the bots with both ends of a prototyping board connector.', '3c65329836.jpg', '2018-11-01 00:40:29', '2018-11-01 00:40:29', NULL),
('19', 'Neodymium Magnet', 'A neodymium magnet (also known as NdFeB, NIB or Neo magnet), the most widely used type of rare-earth magnet, is a permanent magnet made from an alloy of neodymium, iron and boron to form the Nd2Fe14B tetragonal crystalline structure. Developed independently in 1982 by General Motors and Sumitomo Special Metals, neodymium magnets are the strongest type of permanent magnet commercially available. They have replaced other types of magnets in many applications in modern products that require strong permanent magnets, such as motors in cordless tools, hard disk drives and magnetic fasteners.', 'cefa49059d.jpg', '2018-11-01 00:43:48', '2018-11-01 00:44:34', NULL),
('20', 'Copper wire', 'Coated copper wire for making coils. ', '15faa0ecf6.png', '2018-11-01 00:50:03', '2018-11-01 00:51:44', NULL),
('21', 'Hanon Piano Exercises', 'The Virtuoso Pianist by Charles-Louis Hanon, is a compilation of sixty exercises meant to train the pianist in speed, precision, agility, and strength of all of the fingers and flexibility in the wrists.', '554926985f.jpg', '2018-11-09 07:29:32', '2018-11-09 07:31:45', NULL),
('22', 'Carl Czerny: Piano Exercises and Etudes', 'Carl Czerny was an Austrian composer, teacher, and pianist of Czech origin whose vast musical production amounted to over a thousand works. His books of studies for the piano are still widely used in piano teaching. ', '2ab75856b3.jpg', '2018-11-09 07:32:46', '2018-11-09 07:32:46', NULL),
('23', 'Ferdinand Beyer: Piano Book', 'Ferdinand Beyer was a German composer and Pianist. Well known in his day for his light music and piano arrangements of popular orchestral works, he is now mainly known for his book Vorschule im Klavierspiel op.101.', '6cf567f855.jpg', '2018-11-09 07:35:00', '2018-11-09 07:35:00', NULL);
