INSERT INTO `seasons` (`id`, `tv_show_id`, `description`, `rank`, `created_at`, `updated_at`, `deleted_at`) VALUES ('6', '7', 'This is a list of episodes of the children\'s television series The Magic School Bus, which is based on the series of books of the same name written by Joanna Cole.\r\n\r\nThe show\'s continuity is not necessarily dependent on the order in which the episodes aired. In the first episode aired (\"Gets Lost In Space\"), Arnold mentions that the class has already been inside a rotten log (\"Meets the Rot Squad\") and to the bottom of the ocean (various episodes, including \"Gets Eaten,\" \"Blows Its Top,\" and \"Ups and Downs\").', '1', '2018-10-20 16:38:10', '2018-10-20 16:38:10', NULL),
('7', '8', 'Songs for those that like to sing. ', '1', '2018-10-20 22:18:00', '2018-10-20 22:18:00', NULL),
('8', '7', 'In Season 2 adventures, the Magic School Bus takes Ms. Frizzle and her students on field trips to a volcanic island, to a spa for reptiles and more.', '2', '2018-10-21 14:17:49', '2018-10-21 14:17:49', NULL),
('9', '7', 'Hop aboard the Magic School Bus with Ms. Frizzle and her class as they learn about salmon migration, visit a suspension bridge and more in Season 3.', '3', '2018-10-21 14:23:59', '2018-10-21 14:23:59', NULL),
('10', '7', 'Welcome to another season of discovery and wonder as Ms. Frizzle and her class set off for still more adventures aboard the Magic School Bus.', '4', '2018-10-21 14:31:51', '2018-10-21 14:31:51', NULL),
('11', '9', 'From the frozen tundra in the north to the dry forests of the equator, Sir David Attenborough narrates a compelling view of the planet. Episodes offer stunning footage of mountains, plains, jungles, caves and fields of ice. Sand storms, animal migrations, plagues of locusts and more - all are captured on film.', '1', '2018-10-28 13:27:43', '2018-10-28 13:27:43', NULL),
('12', '9', 'Cities are growing at a faster rate than any other habitat on Earth. They may seem an unlikely place for animals to thrive, but for the bold this is a world of surprising opportunity. Leopards prowl the streets of Mumbai, peregrine falcons hunt amongst New Yorks skyscrapers and a million starlings perform spectacular aerial dances over Rome. We welcome some creatures into our cities; in Jodhpur langurs are revered as religious deities and in Harar locals live in harmony with wild hyenas. Many animals, however, are struggling to cope in the urban jungle. As the architects of this environment will we choose to build cities that create a home for both us and for wildlife?', '2', '2018-10-29 01:17:32', '2018-10-29 01:17:32', NULL),
('13', '29', 'Our planet is teeming with myriad life forms, both plant and animal, all interlocked in a struggle for survival. As time goes on, some living things are forced to adapt and change to survive. This programme chronicles some of the most unusual, if not downright bizarre, behaviors that living organisms have devised to keep their species alive. The 11-episode series was four years in the making, taking camera crews to every continent and habitat.', '1', '2018-10-29 08:27:33', '2018-10-29 08:27:33', NULL),
('14', '15', 'The first season of the American animated television series, Rick and Morty originally aired in the United States on Cartoon Network\'s late night programming block, Adult Swim. It premiered on December 2, 2013 with \"Pilot\" and ended on April 14, 2014 with \"Ricksy Business\", with a total of eleven episodes. The first season received critical acclaim.', '1', '2018-10-29 12:02:48', '2018-10-29 12:02:48', NULL),
('15', '15', 'The second season of the animated television series Rick and Morty originally aired on Cartoon Network\'s late night programming block Adult Swim in the United States on July 26, 2015 with \"A Rickle in Time\", and concluded on October 4 with \"The Wedding Squanchers\". This season aired a total of ten episodes.', '2', '2018-10-29 12:04:51', '2018-10-29 12:04:51', NULL),
('16', '15', 'The third season of Rick and Morty, an American animated television series created by Dan Harmon and Justin Roiland, originally aired on Cartoon Network\'s late night programming block, Adult Swim. It premiered with \"The Rickshank Rickdemption\", which aired unannounced on April 1, 2017, as part of Adult Swim\'s annual April Fools\' prank. As a result of production delays, the remaining episodes began airing weekly nearly four months later, on July 30, 2017. The season comprised ten episodes, and its initial airing concluded on October 1, 2017.', '3', '2018-10-29 12:05:12', '2018-10-29 12:05:12', NULL),
('17', '31', 'What will you be when you grow up? Learn about some cool careers - like architect, firefighter, teacher, veterinarian and computer engineer - in this episode of \"StoryBots Super Songs.\"', '1', '2018-10-29 23:46:31', '2018-10-29 23:46:31', NULL),
