('29', '32', '\"Danger, Will Robinson!\" The rest of the Robinson clan should be on the lookout for danger, as well, because they are facing challenging times. It\'s 30 years in the future and the family has been chosen to start a new life in a space colony. On the way to what they believe will be a better world, the Robinsons\' ship is abruptly thrown off course and they are thrown into a dangerous alien environment. Now light-years from their original destination, they must forge new alliances and work together to survive. Stranded with the Robinsons are unsettlingly charismatic Dr. Smith and inadvertently charming Don West, two outsiders who are thrown together by circumstance and a mutual knack for deception.', '1', '2018-10-30 03:18:50', '2018-10-30 03:18:50', NULL),
