('38', '34', 'A table presents data as a scrolling, single-column list of rows that can be divided into sections or groups. Use a table to display large or small amounts of information cleanly and efficiently in the form of a list. Generally speaking, tables are ideal for text-based content, and often appear as a means of navigation on one side of a split view, with related content shown on the opposite side.\r\n\r\niOS implements two styles of table, plain and grouped\r\n\r\nPlain. Rows can be separated into labeled sections, and an optional index can appear vertically along the right edge of the table. A header can appear before the first item in a section, and a footer can appear after the last item.\r\n\r\nGrouped. Rows are displayed in groups, which can be preceded by a header and followed by a footer. This style of table always contains at least one group and each group always contains at least one row. A grouped table doesnt include an index.\r\n\r\nThink about table width. Thin tables can cause truncation and wrapping, making them hard to read and scan quickly at a distance. Wide tables can also be difficult to read and scan, and can take away space from content.\r\n\r\nBegin showing table content quickly. Dont wait for extensive table content to load before showing something. Fill onscreen rows with textual data immediately and show more complex datasuch as imagesas it becomes available. This technique gives people useful information right away and increases the perceived responsiveness of your app. In some cases, showing stale, older data may make sense until fresh, new data arrives.\r\n\r\nCommunicate progress as content loads. If a tables data takes time to load, show a progress bar or spinning activity indicator to reassure people that your app is still running.\r\n\r\nKeep content fresh. Consider updating your tables content regularly to reflect newer data. Just dont change the scrolling position. Instead, add the content to the beginning or end of the table, and let people scroll to it when theyre ready. Some apps display an indicator when new data has been added, and provide a control for jumping right to it. Its also a good idea to include a refresh control, so people can manually perform an update at any time.\r\n\r\nAvoid combining an index with table rows containing right-aligned elements. An index is controlled by performing large swiping gestures. If other interactive elements reside nearby, such as disclosure indicators, it may be difficult to discern the users intent when a gesture occurs and the wrong element may be activated.\r\n\r\nTable Rows\r\n\r\nYou use standard table cell styles to define how content appears in table rows.\r\n\r\nBasic (Default). An optional image on the left side of the row, followed by a left-aligned title. Its a good option for displaying items that dont require supplementary information. For developer guidance, see the UITableViewCellStyleDefault constant of UITableViewCell.\r\n\r\nSubtitle. A left-aligned title on one line and a left-aligned subtitle on the next. This style works well in a table where rows are visually similar. The additional subtitle helps distinguish rows from one another. For developer guidance, see the UITableViewCellStyleSubtitle constant of UITableViewCell.\r\n\r\nRight Detail (Value 1). A left-aligned title with a right-aligned subtitle on the same line. For developer guidance, see the UITableViewCellStyleValue1 constant of UITableViewCell.\r\n\r\nLeft Detail (Value 2). A right-aligned title, followed by a left-aligned subtitle on the same line. For developer guidance, see UITableViewCellStyleValue2 constant of UITableViewCell.\r\n\r\nAll standard table cell styles also allow graphical elements, such as a checkmark or disclosure indicator. Of course, adding these elements decreases the space available for titles and subtitles.\r\n\r\nKeep text succinct to avoid clipping. Truncated words and phrases are hard to scan and decipher. Text truncation is automatic in all table cell styles, but it can present more or less of a problem depending on which cell style you use and where truncation occurs.', '2', '2018-11-06 03:41:45', '2018-11-06 03:41:45', NULL),
