INSERT INTO `tv_shows` (`id`, `name`, `description`, `image`, `is_published`, `created_at`, `updated_at`, `deleted_at`) VALUES ('7', 'The Magic School Bus', 'The Magic School Bus: A Netflix Original\r\nThe Magic School Bus\r\n1997 TV-Y 4 Seasons\r\n\r\nJoin Ms. Frizzle as the Magic School Bus travels to outer space, under the sea, through an anthill -- and even inside the human body!', '19a14d1132.png', '1', '2018-10-20 16:36:39', '2018-10-25 00:55:00', NULL),
('8', 'The Mother Goose Club', 'Mother Goose Club is a series of educational programs for preschoolers featuring six colorful characters from the Mother Goose world. Distributed on YouTube, Netflix and Amazon and broadcast on local PBS stations nationwide, Mother Goose Club is the proud winner of four Midsouth EMMY awards and 15 other industry awards.', '02e8928600.jpg', '1', '2018-10-20 22:16:51', '2018-10-25 00:59:54', NULL),
('9', 'Planet Earth', 'From the frozen tundra in the north to the dry forests of the equator, Sir David Attenborough narrates a compelling view of the planet. Episodes offer stunning footage of mountains, plains, jungles, caves and fields of ice. Sand storms, animal migrations, plagues of locusts and more - all are captured on film', '496795fc03.png', '0', '2018-10-25 02:40:25', '2019-01-18 06:11:14', NULL),
('10', 'Glee', 'Optimistic teacher Will Schuester heads up McKinley High School\'s glee club -- New Directions -- a place where ambitious and talented students can find strength, acceptance and their voice. As the students find themselves, they also enjoy a respite from the harsh realities of life. Mr. Schuester hopes to help the kids in every way he can, and also dreams of taking the group to nationals. As Schuester and the glee club pursue their goal, they face opposition from a conniving cheerleading coach, Sue Sylvester, who tries to sabotage the group at every turn.', 'f1ac18c6b3.jpg', '0', '2018-10-25 03:09:32', '2019-01-18 06:11:33', NULL),
('11', 'Spongebob Squarepants', 'A square yellow sponge named SpongeBob SquarePants lives in a pineapple with his pet snail, Gary, in the city of Bikini Bottom on the floor of the Pacific Ocean. He works as a fry cook at the Krusty Krab. During his time off, SpongeBob has a knack for attracting trouble with his starfish best friend, Patrick. Arrogant octopus Squidward Tentacles, SpongeBob\'s neighbor, dislikes SpongeBob because of his childlike behavior.', '04ae475761.png', '0', '2018-10-25 03:11:33', '2019-01-18 06:11:43', NULL),
('12', 'Friends', 'Three young men and three young women -- of the BFF kind -- live in the same apartment complex and face life and love in New York. They\'re not above sticking their noses into one another\'s business and swapping romantic partners, which always leads to the kind of hilarity average people will never experience -- especially during breakups.', '81bfbb1c80.png', '0', '2018-10-25 03:15:27', '2019-01-18 06:12:01', NULL),
('13', 'Bill Nye The Science Guy', 'William Sanford Nye, popularly known as Bill Nye the Science Guy, is an American science communicator, television presenter, and mechanical engineer.', '8217ce1571.jpg', '1', '2018-10-25 03:23:50', '2018-10-25 03:24:08', NULL),
('14', 'That\'s So Raven', 'No ordinary teenager; Raven Baxter can see glimpses of the future! Watch her schemes and misadventures as she enlists the help of friends, including best friends Eddie and Chelsea, to change life\'s little outcomes. Raven\'s younger brother, Cory, is obsessed with money and creates get-rich-quick schemes to try to earn cash.', '7e1d2edca7.png', '0', '2018-10-25 03:25:41', '2019-01-18 06:11:52', NULL),
('15', 'Rick and Morty', 'After having been missing for nearly 20 years, Rick Sanchez suddenly arrives at daughter Beth\'s doorstep to move in with her and her family. Although Beth welcomes Rick into her home, her husband, Jerry, isn\'t as happy about the family reunion. Jerry is concerned about Rick, a sociopathic scientist, using the garage as his personal laboratory. In the lab, Rick works on a number of sci-fi gadgets, some of which could be considered dangerous. But that\'s not all Rick does that concerns Jerry. He also goes on adventures across the universe that often involve his grandchildren, Morty and Summer.', 'e4ece15b65.jpeg', '0', '2018-10-25 03:30:04', '2018-11-30 16:11:03', NULL),
('16', 'Star Trek: Discovery', 'Created by Bryan Fuller and Alex Kurtzman for CBS All Access, the story of \"Star Trek: Discovery\" begins roughly a decade before Captain Kirk\'s five-year mission -- as portrayed in the original \"Star Trek\" from the 1960s -- and a century before the events of \"Star Trek: Enterprise.\" The series follows the crew of the USS Discovery as they encounter new worlds and civilizations, delving into familiar themes and expanding upon an incident that has been talked about within the franchise\'s universe, but never fully explored.', 'f31ee205c9.png', '0', '2018-10-25 03:32:09', '2019-01-18 06:12:25', NULL),
('17', 'The Big Bang Theory', 'Mensa-fied best friends and roommates Leonard and Sheldon, physicists who work at the California Institute of Technology, may be able to tell everybody more than they want to know about quantum physics, but getting through most basic social situations, especially ones involving women, totally baffles them. How lucky, then, that babe-alicious waitress/aspiring actress Penny moves in next door. Frequently seen hanging out with Leonard and Sheldon are friends and fellow Caltech scientists Wolowitz and Koothrappali. Will worlds collide? Does Einstein theorize in the woods?', 'd937a0acf2.png', '0', '2018-10-25 03:33:20', '2019-01-18 06:10:53', NULL),
('18', 'Penguins of Madagascar', 'Plucky penguins Skipper (Tom McGrath), Kowalski (Chris Miller), Rico (Conrad Vernon) and Private (Christopher Knights) -- the most elite spies ever hatched -- join forces with a chic undercover organization known as the North Wind. Led by highly trained, handsome and arrogant Agent Classified (Benedict Cumberbatch), this special inter-species task force must stop a many-tentacled villain, Dr. Octavius Brine (John Malkovich), from destroying the world.', '73f741d892.jpeg', '0', '2018-10-25 03:39:17', '2019-01-18 06:10:42', NULL),
('19', 'South Park', 'The animated series is not for children. In fact, its goal seems to be to offend as many as possible as it presents the adventures of Stan, Kyle, Kenny and Cartman. The show has taken on Saddam Hussein, Osama bin Laden, politicians of every stripe and self-important celebrities. Oh, and Kenny is killed in many episodes.', 'a6916bd899.png', '0', '2018-10-29 07:44:45', '2019-01-18 06:10:13', NULL),
('20', 'Side By Side', 'Through the methodology of guided conversations, Side by Side engages students through an engaging, fun and easy-to-use format. Students are encouraged to move beyond the textbook to create conversations on their own.', '36acc0a7a8.jpg', '1', '2018-10-29 07:48:17', '2018-10-29 07:49:55', NULL),
('21', 'Meet the phonics', 'Learning phonics has never been this easy!\r\n\r\nChildren will fall in love with these wonderful characters as they Meet the Letter Sounds, Meet the Digraphs and Meet the Blends!', '120e5b3e6b.jpg', '1', '2018-10-29 07:57:30', '2018-10-29 08:04:02', NULL),
('22', 'Star Trek: Next Generation', 'Featuring a bigger and better USS Enterprise, this series is set 78 years after the original series -- in the 24th century. Instead of Capt. James Kirk, a less volatile and more mature Capt. Jean-Luc Picard heads the crew of various humans and alien creatures in their adventures in space -- the final frontier.', '0d61483de6.png', '0', '2018-10-29 08:06:27', '2019-01-18 06:09:57', NULL),
('23', 'Growing Pains', 'The \"Father Knows Best\" of the 1980s, Dr. Jason Seaver is a psychiatrist who has moved his practice into his Long Island, N.Y., home so that his wife, Maggie, can resume her career. Their children are girl-crazy Mike, brainiac Carol and cute little Ben (later, precocious Chrissie was born). This series, however, tackles issues that \"Father Knows Best\" wouldn\'t have: drugs, suicide, peer pressure, alcohol. But the Seavers pull through problems with a sense of humor and usually emerge stronger than before.', '67a22d36e3.png', '0', '2018-10-29 08:08:27', '2019-01-18 06:09:45', NULL),
('24', 'Star Trek: The Original Series', 'The iconic series \"Star Trek\" follows the crew of the starship USS Enterprise as it completes its missions in space in the 23rd century. Captain James T. Kirk -- along with half- human/half-Vulcan science officer Spock, ship Dr. \"Bones\" McCoy, Ensign Pavel Chekov, communications officer Lt. Nyota Uhura, helmsman Lt. Hikaru Sulu and chief engineer Lt. Cmdr. Montgomery \"Scotty\" Scott -- confront strange alien races, friendly and hostile alike, as they explore unknown worlds.', '8489897f8f.png', '0', '2018-10-29 08:10:29', '2019-01-18 06:09:28', NULL),
('25', 'Nova', 'This long-running, award-winning documentary series focuses on science - the speculation, history and researchers associated with it and its many applications. Inspired by the BBC documentary program `Horizons\', the U.S. series frequently features interviews with scientists directly involved in the topic at hand, and sometimes even boasts footage of a particular discovery.', '03ee7468c2.png', '0', '2018-10-29 08:12:27', '2019-01-18 06:10:22', NULL),
('26', 'The Story of Maths', 'Co-produced by the BBC and presented by Oxford professor Marcus du Sautoy, this miniseries covers such subjects as the invention of zero and the Riemann hypothesis, the contributions of great mathematicians including Pythagoras, Plato and Euclid, and some of the biggest unsolved problems that confronted math scholars in the 20th century. Also, du Sautoy examines key mathematical ideas and their influence on today\'s science, technology and culture.', 'daa00fb57a.jpg', '0', '2018-10-29 08:14:30', '2019-01-18 06:12:34', NULL),
('27', 'The Story of Science', 'Michael Mosley takes an informative and ambitious journey exploring how the evolution of scientific understanding is intimately interwoven with society\'s historical path.', 'f726659f31.png', '0', '2018-10-29 08:16:32', '2019-01-18 06:09:15', NULL),
('28', 'Mr. Bean', 'Mr. Bean is a British sitcom created by Rowan Atkinson and Richard Curtis, produced by Tiger Aspect Productions, and starring Atkinson as the title character. The sitcom consisted of 15 episodes that were co-written by Atkinson, alongside Curtis and Robin Driscoll; for the pilot, it was co-written by Ben Elton.', '814ea89a87.png', '0', '2018-10-29 08:18:24', '2019-01-18 06:09:03', NULL),
('29', 'Life', 'Our planet is teeming with myriad life forms, both plant and animal, all interlocked in a struggle for survival. As time goes on, some living things are forced to adapt and change to survive. This programme chronicles some of the most unusual, if not downright bizarre, behaviors that living organisms have devised to keep their species alive. The 11-episode series was four years in the making, taking camera crews to every continent and habitat.', 'c6004dba4d.png', '0', '2018-10-29 08:25:13', '2019-01-18 06:08:54', NULL),
('30', 'Ozzy and Drix ', '', '647e0ef8ab.jpg', '0', '2018-10-29 08:45:12', '2019-01-18 06:08:43', NULL),
('31', 'StoryBots Super Songs', 'The Storybots give lessons on math, science, history, behaviour and more, singing songs together and dancing around.', '2b5a7dc36b.jpg', '1', '2018-10-29 23:44:58', '2018-10-30 00:05:51', NULL),
('32', 'Lost in Space', '\"Danger, Will Robinson!\" The rest of the Robinson clan should be on the lookout for danger, as well, because they are facing challenging times. It\'s 30 years in the future and the family has been chosen to start a new life in a space colony. On the way to what they believe will be a better world, the Robinsons\' ship is abruptly thrown off course and they are thrown into a dangerous alien environment. Now light-years from their original destination, they must forge new alliances and work together to survive. Stranded with the Robinsons are unsettlingly charismatic Dr. Smith and inadvertently charming Don West, two outsiders who are thrown together by circumstance and a mutual knack for deception.', '14653e6bad.jpg', '0', '2018-10-30 03:18:18', '2019-01-18 06:08:29', NULL),
('33', 'Boston Legal', 'The Boston law firm Crane, Poole and Schmidt deals in the often high-priced world of civil litigation, where smarmy Alan Shore feels at home. Loose cannon Denny Crane has the run of the place, while other members of the firm try -- with often dismal results -- to keep him in check.', 'a3fefe362e.jpg', '0', '2018-10-30 03:36:36', '2019-01-18 06:08:19', NULL),
('34', 'Swift 4.2', 'Swift is a powerful and intuitive programming language for macOS, iOS, watchOS and tvOS. Writing Swift code is interactive and fun, the syntax is concise yet expressive, and Swift includes modern features developers love. Swift code is safe by design, yet also produces software that runs lightning-fast.', 'e99f97c1fb.png', '0', '2018-11-06 03:35:08', '2019-02-07 00:44:56', NULL),
('35', ' Super Simple Songs', 'The Wiggles & Super Simple Songs are bringing you this collection of their favorite children\'s songs! This playlist includes some of the most loved kids songs and nursery rhymes on YouTube.', 'cd7e82e37e.jpg', '1', '2019-01-18 08:03:54', '2019-01-18 08:13:57', NULL),
('36', 'Basic Math', 'Learn how to do math in English', 'f5574df0c9.jpg', '1', '2019-01-22 06:57:51', '2019-03-05 03:25:22', NULL),
('37', 'Movies', 'Here you will find uploaded movies.', '5e42e8d560.jpg', '1', '2019-01-30 08:02:54', '2019-01-30 08:19:36', NULL),
('38', 'Yipee', 'This course incrementally teaches the basics of language skills. ', 'e7e83ab5ae.jpg', '1', '2019-02-07 00:59:04', '2019-02-07 00:59:14', NULL),
('39', 'Study English IELTS Preparation ', 'Study English is designed for intermediate to advanced English language learners, especially those using English for study purposes.\r\n\r\nIELTS stands for the International English Language Testing System, and is an internationally recognised test of English language proficiency.\r\n\r\nAustralia Network in partnership with Insearch, University of Technology, Sydney have produced 2 TV series of Study English for a total of 52 episodes. All episodes are available online with downloads, notes and activities to help you pass your IELTS test: http://australianetwork.com/studyenglish\r\n', 'dabc664b8b.png', '1', '2019-02-08 13:41:09', '2019-02-08 13:41:27', NULL),
('40', 'Stories for Kids', 'Wonderful Stories for Kids', '555f0b8b41.jpg', '1', '2019-03-04 06:27:31', '2019-03-04 06:29:04', NULL),
('41', 'American English Pronunciation', 'Improve your American Accent / spoken English at Rachel\'s English with video-based lessons and exercises.  ', 'fbdbadee8a.jpg', '1', '2019-05-20 01:57:58', '2019-05-20 01:58:29', NULL),
('42', ' Kurzgesagt  In a Nutshell', 'Videos explaining things with optimistic nihilism. \r\n\r\nWe are a small team who want to make science look beautiful. Because it is beautiful. \r\n\r\nCurrently we make one animation video per month. Follow us on Twitter, Facebook to get notified when a new one comes out.', 'b5032d4ce6.jpg', '1', '2019-06-10 10:48:12', '2019-06-10 11:20:12', NULL);
